        [StringName.HowToPlayText41]: "If you already have an Among Us account on another platform, you may be able to link to that account! Alternatively, you can create a brand new account.",
        [StringName.HowToPlayText42]: "Firstly, determine who you want to play with!\n\nIf you want to play with friends online, set to \"private\" and share the room code.\n\nIf you want to play with others from all around the world, set to \"public\".",
