        [StringName.HowToPlayText5]: "While playing in person, no talking is allowed to keep the game fair between The Crew and The Impostor.\n\nIf a player is killed by The Impostor, they cannot talk until the game ends.\n\nGhosts still run their assigned tasks working towards a possible Crewmates win.",
