        [StringName.TagFiltersHelpFindGame]: "You can filter game searches by selecting tags from the Filters dropdown list. Filters you select will match the search results <i>exactly</i>.\n\nExample: If you select <b>Casual</b> and <b>Expert</b> you will only find games tagged with both <b>Casual</b> and <b>Expert</b> filters.",
        [StringName.TagFiltersHelpCreate]: "You can tag your game with filters to help players find your game. Filters you select will match the search results <i>exactly</i>.\n\nExample: If you select <b>Casual</b> and <b>Expert</b> only people who search for both <b>Casual</b> and <b>Expert</b> filters will see your game.",
        [StringName.CreateLabel]: "Create",
        [StringName.NewGameMode]: "New Game Mode!",
        [StringName.NewModeInfo]: "The stakes are high in this heart-stopping game mode! \n<i>But wait - it's not your ordinary Hide n Seek...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "It's simple!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Crewmates!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Impostors!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Crewmates:</b></color> Complete tasks to speed up the clock, avoid the Impostor, and stay alive until the timer runs out.\n\n<color=#FF3131><b>The Impostor:</b></color> Find the Crewmates and go on a killing spree.",
        [StringName.HideSeekHowToPlaySubtextOne]: "No social deduction here, just terrified screaming.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Master your hiding and sneaking skills in order to survive.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "In this mode you can use vents and get a high-tech Danger Meter that alerts you when the Impostor is getting closer. The Impostor has a limited range of vision, so use your wits, vents, and visors to dodge them!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Impostors can't vent in this mode, so you'll need to act fast to catch your prey. It's dark out there! Luckily you have a Flashlight to help you find your next victims.",
        [StringName.HideSeekHowToPlayFinalHide]: "It's the finaaaal countdownnnn. In the last moments of the game, the Impostor gets a power boost - they're faster, get a special Seek map, and a directional ping to where any surviving Crewmates are.\n\nThink fast and run away strategically to win!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Use the Flashlight virtual joystick on the right side of your screen to direct your beam and kill all the Crewmates you can find!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Use your mouse to direct your Flashlight beam and kill all the Crewmates you can find!",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Use the Right Stick to direct your beam and kill all the Crewmates you can find!",
        [StringName.HideSeekHowToPlayFlashlightPlayStation]: "Use the Right Stick to direct your beam and kill all the Crewmates you can find!",
