        [StringName.NoisemakerBlurbMed]: "Alert all Crewmates of your location when killed.",
        [StringName.NoisemakerBlurbLong]: "The Noisemaker is no ordinary Crewmate role. They don’t have an ability to use like all other roles. Instead, they automatically send out an alert when they are killed by an Impostor. The alert easily sends the Impostor into a panic. Watch your fellow Crewmates rush to the scene of the crime to catch the killer and avenge your death!",
