        [StringName.PhantomBlurbMed]: "Turn invisible to sneak around or get away from a kill.",
        [StringName.PhantomBlurbLong]: "The Phantom can turn invisible to stealthily sneak up to a Crewmate or leave the scene of a crime without getting caught. They can’t kill while invisible, but they can still use ladders and ziplines. Turning invisible and vice versa creates a big smoke cloud so make sure no Crewmates are in the area! The invisibility also doesn’t last forever so make sure to time the ability right.",
