        [StringName.LocalHelp]: "¿Mala conexión?\n\n● Verifica que todos se conecten a la misma red wifi.\n● Verifica que todos tengan la misma versión (esquina inferior derecha).\n● Verifica la potencia de la señal wifi.\n● A veces todo mejora si otra persona organiza la partida.\n● Reinicia la aplicación.\n● ... o el teléfono.\n● ¿Aún tienes problemas? ¡Mándanos un correo a support@innersloth.com!",
        [StringName.OnlineHelp]: "¿Cómo funciona?\n\n● Cuando organizas una partida obtienes un código en el panel de la sala.\n● Compártelo con amigos para crear una sala privada.\n● O toca Privada para cambiar la sala a pública y usar Buscar partida.\n● La persona que organiza puede vetar o expulsar jugadores si el chat está disponible.\n● ¿Aún tienes problemas? ¡Mándanos un correo a support@innersloth.com!",
        [StringName.EmergencyCount]: "EL TRIPULANTE {0} TIENE\n\n\n\nREUNIÓN(ES) URGENTE(S) RESTANTE(S)",
        [StringName.EmergencyNotReady]: "LA TRIPULACIÓN DEBE ESPERAR\n\n\n\nPARA LA PRÓXIMA REUNIÓN",
        [StringName.EmergencyDuringCrisis]: "NO SE PUEDEN HACER\nREUNIONES URGENTES DURANTE UNA CRISIS",
        [StringName.EmergencyRequested]: "REUNIÓN URGENTE SOLICITADA\nESPERANDO ORGANIZADOR",
        [StringName.AdPolicyTitle]: "Política de anuncios",
        [StringName.AdPolicyText]: "¿Podemos usar tus datos personales para proporcionarte anuncios personalizados? Si haces clic en Sí, nuestros socios publicitarios como Google AdMob y Unity Ads recolectarán información de forma automática y usarán identificadores de dispositivos y cookies para personalizar los anuncios. Si haces clic en No, puede que continúes viendo anuncios no personalizados. Para eliminar todos los anuncios, compra la mejora sin publicidad [httpstore]aquí[] para que ni tus amigos ni tú vean publicidad al organizar una partida. Para saber más sobre las prácticas de privacidad de los socios publicitarios, consulta la [https://www.innersloth.com/esmx/privacy-policy-mx/]Política de privacidad[]. Puedes cambiar de opinión en cualquier momento desde el menú de configuración en \"Datos\".",
        [StringName.Accept]: "Aceptar",
