        [StringName.StarDisclaimer]: "¡Adquiere estrellas de Among Us para desbloquear una galaxia completamente nueva de personalización! ¡Gasta tus estrellas en la tienda del juego para obtener objetos estéticos exclusivos y Cosmicubos únicos! No puedes usar o canjear las estrellas que compres aquí en PlayStation® o Nintendo Switch™.",
