        [StringName.ItchNoStars]: "Por desgracia, la compra de estrellas no está disponible en itch.io. Sin embargo, si vinculas tu cuenta de itch.io con otra plataforma (como otras versiones del juego en PC), ¡podrás comprar y acceder a las estrellas desde esa plataforma! Nota: Las estrellas que compres en Nintendo Switch™ no son multiplataforma, por lo que no podrás canjearlas en otra plataforma.",
