        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Rol del tripulante: {0}",
            "ImpostorRole": "Rol del impostor: {0}",
            "Scientist_01": "El científico tiene acceso al panel portátil en cualquier lugar para verificar el estado de la tripulación.",
            "Scientist_02": "Sin embargo, el panel necesita recargarse, por lo que el científico deberá completar tareas para llenar la batería.",
            "Engineer_01": "El ingeniero es un tripulante que puede usar los ductos para desplazarse más rápido y atrapar a los impostores con las manos en la masa.",
            "Engineer_02": "No puedes quedarte ahí para siempre, sería muy sospechoso. Así que cuidado con quien te vea usar el ducto.",
            "GuardianAngel_01": "El ángel guardián es el fantasma de un tripulante. Puedes proteger temporalmente a otros tripulantes vivos.",
            "GuardianAngel_02": "Usa bien este poder para evitar que los impostores asesinen a su víctima. ¡Qué suerte!",
            "Shapeshifter_01": "El cambiaformas puede cambiar su apariencia y disfrazarse de otros tripulantes. ¡Hazlo bien para engañar a otros tripulantes y crear confusión sobre la verdadera identidad del impostor!",
            "Shapeshifter_02": "Pero cuidado, el disfraz no dura por siempre y deja evidencias.",
            "Noisemaker_01": "El alertador no es un rol de tripulante común, ya que no tiene una habilidad activa como los demás. En su lugar, envía una alerta automática cuando muere a manos de un impostor.",
            "Noisemaker_02": "Esto conseguirá atemorizar al impostor. ¡Mira cómo los demás tripulantes corren a toda velocidad a la escena del crimen para atraparlo y vengar tu muerte!",
            "Tracker_01": "El localizador puede ver la ubicación de un tripulante en el minimapa. Para hacerlo, necesita estar junto al tripulante y colocarle un dispositivo rastreador. Cuidado, no debes levantar sospechas al acercarte al tripulante al que le colocarás el dispositivo.",
            "Tracker_02": "El efecto rastreador solo dura unos segundos, así que elige bien a tu objetivo. ¡Y no te quedes mirando el mapa sin moverte o un impostor podría convertirte en su víctima!",
            "Phantom_01": "El espectro puede volverse invisible para acechar a un tripulante o para salir de la escena del crimen sin que nadie lo vea. No puede asesinar mientras está invisible, pero puede usar escaleras y tirolesas.",
            "Phantom_02": "Usar la invisibilidad o cancelarla genera una gran nube de humo, ¡así que asegúrate de que no haya ningún otro tripulante en la zona! La duración de la invisibilidad es limitada, por lo que debes usarla en el momento adecuado.",
            "Detective_01": "El detective es un tripulante que se especializa en investigar los asesinatos. Con sus notas, es capaz de registrar información relevante de cada asesinato.",
            "Detective_02": "El detective puede interrogar a otros tripulantes para averiguar sus paraderos cuando sucedió un asesinato. Conecta las pistas y encuentra al impostor.",
            "Viper_01": "La sierpe usa un ácido mortífero para eliminar a los tripulantes. Los cuerpos se disuelven lentamente a lo largo de tres etapas antes de desaparecer.",
            "Viper_02": "Una sierpe astuta se asegura de que nadie encuentre a sus víctimas. ¡Aprovecha los sabotajes al máximo!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "¡Los roles le agregan un nuevo nivel de estrategia y engaño al juego clásico!",
            "02": "Tanto tripulantes como impostores pueden tener roles que se asignan de forma aleatoria según la configuración seleccionada por el anfitrión."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Los roles se pueden personalizar. Los anfitriones del juego pueden elegir cuántas veces un ingeniero puede usar los ductos y el tiempo de recuperación del cambiaformas, etc. También pueden elegir el porcentaje de probabilidad de que estos roles se asignen en el juego. Puedes consultar en los ajustes de la sala de juego si un rol está activo.",
            "02": "Prueba los ajustes que más te gusten para crear tu sala ideal o únete a otra y mira el caos que puedes causar. Puede que continuemos añadiendo roles en el futuro, así que puedes volver a consultar por aquí cuando quieras. ¡Que te diviertas!"
        },
