        [StringName.ScientistBlurbLong]: "El científico puede acceder al panel portátil de los estados en cualquier lugar para ver el estado de la tripulación. Pero el panel portátil de los estados necesita recargarse, así que el científico debe completar tareas para recargar la batería.",
