        [StringName.MergeGuestAccountText]: "¡Parece que hay una <link=\"https://www.innersloth.com/merging-guest-accounts/\">cuenta de invitado</link> en este dispositivo! Pronto dejaremos de gestionar cuentas de invitado, se combinarán todos los objetos, monedas y la experiencia de tu cuenta de invitado con esta de {0}.\n\nSi compartes este dispositivo (computadora, teléfono, etc.) con otras personas, toma en cuenta que quienes lo usan COMPARTEN esta cuenta. Si continuas, ningún otro usuario de este dispositivo podrá combinar esta cuenta de invitado y solo puedes combinarla UNA vez. No podrás redistribuir los objetos, monedas y experiencia vinculados a esta cuenta de invitado.\n\nConfirma que deseas combinar tu cuenta de invitado con esta cuenta de {0}.",
