        [StringName.TagFiltersHelpFindGame]: "Puedes filtrar búsquedas al seleccionar etiquetas de la lista desplegable. Los filtros que selecciones coincidirán con los resultados de la búsqueda <i>con exactitud</i>.\n\nPor ejemplo, si seleccionas <b>casual</b> y <b>experto</b>, solo encontrarás partidas etiquetadas con los filtros <b>casual</b> y <b>experto</b>.",
        [StringName.TagFiltersHelpCreate]: "Puedes etiquetar tu partida con filtros para ayudar a otros jugadores a encontrarla. Los filtros que selecciones coincidirán con los resultados de la búsqueda <i>con exactitud</i>.\n\nPor ejemplo, si seleccionas <b>casual</b> y <b>experto</b>, solo aquellos que busquen las etiquetas <b>casual</b> y <b>experto</b> podrán ver tu partida.",
        [StringName.CreateLabel]: "Crear",
        [StringName.NewGameMode]: "¡Nuevo modo de juego!",
        [StringName.NewModeInfo]: "¡Todo es de alto riesgo en este nuevo modo de juego lleno de adrenalina! \n<i>Pero espera, no es El escondite de siempre...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "¡Es fácil!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "¡Tripulantes!",
        [StringName.HideSeekHowToPlayCaptionThree]: "¡Impostores!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Tripulantes:</b></color> completen las tareas para acelerar el reloj, eviten al impostor y manténganse con vida hasta que el tiempo se agote.\n\n<color=#FF3131><b>Impostor:</b></color> encuentra a los tripulantes y acaba con ellos.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Sin tanta discusión, solo gritos de terror.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Domina el arte del escondite y el sigilo para sobrevivir.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "En este modo, puedes usar los ductos y obtener un peligrómetro de alta tecnología que te alerta cuando un impostor anda cerca. El impostor tiene un alcance de visión limitado, ¡así que usa tu ingenio, los ductos y las viseras para que no te vea!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Los impostores no pueden usar los ductos en este modo de juego. Deberás actuar rápido para atrapar a la presa. ¡Está oscuro! ¡Por suerte, tienes una linterna que te ayudará a encontrar a tu próxima víctima!",
        [StringName.HideSeekHowToPlayFinalHide]: "Es el conteo finaaaaaaaal. En los últimos momentos del juego, el impostor obtiene una mejora de energía: se vuelve más rápido, obtiene un mapa de búsqueda especial y una alerta direccional hacia donde se encuentran los tripulantes.\n\n¡Piensa rápido y huye estratégicamente para ganar!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "¡Usa el ícono linterna a la derecha de tu pantalla para dirigir la luz y asesinar a todos los tripulantes que encuentres!",
