        [StringName.HowToPlayText41]: "O anfitrião controla as regras do jogo.",
        [StringName.HowToPlayText42]: "Primeiro, você deve determinar com quem quer jogar!\n\nSe quiser jogar com seus amigos online, crie uma partida \"privada\" e compartilhe o código da sala.\n\nSe quiser jogar com gente do mundo inteiro, crie uma partida \"pública\".",
        [StringName.HowToPlayText43]: "Quer mais tarefas? Que tal andar mais rápido? Mais Impostores? Como anfitrião, você pode alterar essas configurações. Mas não deixe de comunicar as alterações aos outros jogadores.",
