        [StringName.HowToPlayTextImp6]: "Feche portas e prenda vítimas.",
        [StringName.HowToPlayTextImp7]: "Objetivo: eliminar Tripulação entre esperas.",
        [StringName.HowToPlayText5]: "Ao jogar com amigos no mesmo ambiente físico, não é permitido conversar (para manter o jogo justo entre a Tripulação e o Impostor).\n\nSe um jogador for morto pelo Impostor, ele não pode falar enquanto a partida não acabar.\n\nOs Fantasmas continuam a cumprir tarefas para levar uma possível vitória à Tripulação.",
        [StringName.HowToPlayText6]: "Quando alguém notifica um corpo ou convoca uma reunião de emergência, a Tripulação se reúne para discutir o que sabe sobre o Impostor.\n\nOs jogadores podem então conversar abertamente sobre quem suspeitam que seja o Impostor e sobre suas informações. Ao jogar com amigos no mesmo ambiente físico, os Fantasmas não podem falar, pois já sabem quem é o Impostor.\n\nOs Impostores vão tentar provar sua inocência ou acusar outros Tripulantes.",
        [StringName.HowToPlayText7]: "Após a discussão, vote em quem você acha que é o Impostor.\n\nO mais votado será ejetado da nave, então vote com cuidado!\n\nSe você não tiver informações o suficiente, ou se a Tripulação assim decidir, é possível pular a votação e evitar que um inocente seja ejetado, ganhando tempo para juntar mais informações.",
        [StringName.HowToPlayText81]: "Treine no modo Prática!",
        [StringName.HowToPlayText82]: "Defina suas próprias tarefas como Tripulante ou pratique suas estratégias malignas de Impostor!",
