        [StringName.AdPolicyTitle]: "Política de anúncios",
        [StringName.AdPolicyText]: "Podemos usar seus dados pessoais para adaptar anúncios para você? Ao escolher \"Sim\", nossos parceiros de publicidade, como o Google AdMob e o Unity Ads, coletarão dados e usarão identificadores de dispositivo e cookies para personalizar os seus anúncios automaticamente. Ao escolher \"Não\", anúncios não personalizados ainda podem aparecer para você. Para remover todos os anúncios, adquira a atualização sem anúncios [httpstore]aqui[]. Com ela, você e seus amigos não verão mais anúncios quando você for o anfitrião! Para saber mais sobre as práticas de privacidade dos nossos parceiros, confira a nossa [https://www.innersloth.com/pt/prviacy-policy-br/]Política de Privacidade[]. É possível alterar essa decisão a qualquer momento na seção \"Dados\" do menu de configurações.",
