        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Função do Tripulante: {0}",
            "ImpostorRole": "Função do Impostor: {0}",
            "Scientist_01": "O Cientista tem um dispositivo portátil capaz de verificar os sinais vitais da tripulação de onde estiver.",
            "Scientist_02": "Esse dispositivo, porém, funciona a bateria, e o Cientista terá que cumprir tarefas para recarregá-la.",
            "Engineer_01": "O Engenheiro é um Tripulante que também pode se deslocar pelos dutos — e ainda pegar os Impostores no pulo enquanto isso!",
            "Engineer_02": "Mas você não pode ficar no duto para sempre, isso é um pouco suspeito, então é bom ficar de olho aberto...",
            "GuardianAngel_01": "O Anjo da Guarda é o fantasma de um Tripulante. Ele pode proteger os Tripulantes vivos com uma barreira temporária.",
            "GuardianAngel_02": "Se usada na hora certa, ela pode impedir que os Impostores matem a vítima. Que sorte, hein!",
            "Shapeshifter_01": "O Metamorfo pode mudar de aparência, assumindo a forma de outros Tripulantes. Se fizer boas jogadas, você pode jogar a culpa em Tripulantes e criar confusão a respeito da identidade dos Impostores!",
            "Shapeshifter_02": "Mas cuidado! O disfarce não dura para sempre e deixa certas pistas para trás.",
            "Noisemaker_01": "O Sirene não é um Tripulante comum. Ele não tem uma habilidade como as outras Funções. Em vez disso, ele automaticamente emite um alerta ao ser abatido por um Impostor.",
            "Noisemaker_02": "O alerta faz o Impostor entrar em pânico. Veja os outros Tripulantes correrem para a cena do crime para pegar o assassino e vingarem sua morte!",
            "Tracker_01": "O Rastreador pode ver a posição de outros Tripulantes no minimapa. Primeiro, ele precisa ficar perto de outro Tripulante para posicionar o dispositivo de rastreio. Cuidado para não levantar suspeitas ao se aproximar de outro Tripulante.",
            "Tracker_02": "O rastreamento só dura alguns segundos, então escolha bem o seu alvo. Não seja pego olhando o minimapa por muito tempo. Isso te deixa muito vulnerável ao Impostor!",
            "Phantom_01": "O Espectro pode ficar invisível para se aproximar sorrateiramente de um Tripulante ou fugir da cena do crime sem ser pego. Ele não pode matar enquanto estiver invisível, mas pode usar escadas e tirolesas.",
            "Phantom_02": "Ficar invisível e visível cria uma grande nuvem de fumaça, então garanta que nenhum outro Tripulante esteja por perto! A invisibilidade também não dura para sempre, então calcule bem o momento de usar a habilidade.",
            "Detective_01": "O Detetive é um Tripulante especialista em solucionar assassinatos! Com suas Notas, eles registram informações importantes sobre cada morte.",
            "Detective_02": "O Detetive pode Interrogar outros Tripulantes para determinar o paradeiro de cada um na hora do crime. Conecte os pontos e encontre o assassino!",
            "Viper_01": "A Víbora usa um ácido letal para matar Tripulantes. Os corpos se dissolvem em três fases antes de desaparecer completamente.",
            "Viper_02": "Uma Víbora esperta garante que suas vítimas nunca sejam encontradas. Aproveite as sabotagens ao máximo!"
        },
