        [StringName.TagFiltersHelpFindGame]: "Você pode filtrar buscas no jogo selecionando marcações a partir da lista suspensa de filtros. Os resultados corresponderão <i>exatamente</i> aos filtros selecionados.\n\nExemplo: se você selecionar <b>Casual</b> e <b>Especialista</b>, somente jogos marcados com os filtros <b>Casual</b> e <b>Especialista</b> aparecerão.",
        [StringName.TagFiltersHelpCreate]: "Você pode atribuir filtros ao seu jogo para facilitar a busca de outros jogadores. Os resultados corresponderão <i>exatamente</i> aos filtros selecionados.\n\nExemplo: se você selecionar <b>Casual</b> e <b>Especialista</b>, o seu jogo só aparecerá para quem fizer a busca com os filtros <b>Casual</b> e <b>Especialista</b>.",
        [StringName.CreateLabel]: "Criar",
        [StringName.NewGameMode]: "Novo modo de jogo!",
        [StringName.NewModeInfo]: "Tem muita coisa em jogo neste modo eletrizante!\n<i>Mas atenção: não estamos falando de uma brincadeira de esconde-esconde qualquer...<i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "É simples!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Tripulantes!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Impostores!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Tripulantes:</b></color> Concluam tarefas para acelerar o relógio, fujam do Impostor e fiquem vivos até o tempo acabar.\n\n<color=#FF3131><b>Impostor:</b></color> Localize os Tripulantes e saia matando geral.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Aqui não tem essa de conversa e dedução – só gritos aterrorizantes.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Domine suas habilidades de esconde-esconde para sobreviver.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "Neste modo, você pode usar os dutos e obter um Medidor de Perigo de alta tecnologia que alerta você quando o Impostor estiver se aproximando. O Impostor tem alcance de visão limitado, então use sua astúcia, os dutos e os visores para se esquivar dele!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Impostores não podem usar os dutos neste modo, então você terá que ser ágil para capturar a presa. Está escuro lá fora! Por sorte, você tem uma lanterna para ajudar a localizar as próximas vítimas.",
        [StringName.HideSeekHowToPlayFinalHide]: "E comeeeeeeça a contagem final! Nos momentos finais do jogo, o Impostor ganha um impulso de poder – ele fica mais rápido, ganha um mapa de rastreamento especial e um ping direcional que aponta a localização dos Tripulantes sobreviventes.\n\nPense rápido e fuja estrategicamente para vencer!",
