        [StringName.NoisemakerBlurbLong]: "O Sirene não é um Tripulante comum. Ele não tem uma habilidade como as outras Funções. Em vez disso, ele automaticamente emite um alerta ao ser abatido por um Impostor. O alerta faz o Impostor entrar em pânico. Veja os outros Tripulantes correrem para a cena do crime para pegar o assassino e vingarem sua morte!",
