        [StringName.PhantomBlurb]: "Ficar invisível",
        [StringName.PhantomBlurbMed]: "Fique invisível para passar despercebido ou\npara escapar.",
        [StringName.PhantomBlurbLong]: "O Espectro pode ficar invisível para se aproximar sorrateiramente de um Tripulante ou fugir da cena do crime sem ser pego. Ele não pode matar enquanto estiver invisível, mas pode usar escadas e tirolesas. Ficar invisível e visível cria uma grande nuvem de fumaça, então garanta que nenhum outro Tripulante esteja por perto! A invisibilidade também não dura para sempre, então calcule bem o momento de usar a habilidade.",
