        [StringName.LocalHelp]: "Probz de ligação?\n\n● Verifica se estão todos ligados à mesma rede Wi-Fi.\n● Verifica se todos têm a mesma versão (no canto inferior direito).\n● Verifica se o teu sinal Wi-Fi é forte.\n● Às vezes o melhor é deixar outro jogador organizar a partida.\n● Às vezes o melhor é reiniciar o jogo...\n● Às vezes o melhor é reiniciar o telemóvel...\n● Continuas com problemas? Contacta-nos através do e-mail support@innersloth.com!",
        [StringName.OnlineHelp]: "Como é que isto funciona?\n\n● Organizar um jogo exibe um código de jogo no painel da sala de espera.\n● Partilha o código com os teus amigos para criar uma sala privada.\n● Ou toca em \"Privada\" para tornar a sala pública e exibi-la na opção \"Procurar partida\".\n● Os organizadores podem banir ou expulsar jogadores sempre que o chat estiver disponível.\n● Continuas com problemas? Contacta-nos através do e-mail support@innersloth.com!",
        [StringName.EmergencyCount]: "O TRIPULANTE {0} TEM\n\n\n\nREUNIÕES DE EMERGÊNCIA RESTANTES",
        [StringName.EmergencyNotReady]: "OS TRIPULANTES DEVEM ESPERAR\n\n\n\nATÉ À PRÓXIMA EMERGÊNCIA.",
        [StringName.EmergencyDuringCrisis]: "AS REUNIÕES DE EMERGÊNCIA NÃO PODEM\nSER CONVOCADAS EM CRISES.",
        [StringName.EmergencyRequested]: "PEDIDO DE REUNIÃO DE EMERGÊNCIA\nA AGUARDAR ORGANIZAÇÃO.",
        [StringName.AdPolicyTitle]: "Política de Publicidade",
        [StringName.AdPolicyText]: "Podemos usar os teus dados para gerar anúncios personalizados? Se clicares em Sim, os nossos parceiros de publicidade, tais como o Google AdMob e o Unity Ads, irão recolher automaticamente dados e utilizar os identificadores e cookies do dispositivo para personalizar anúncios. Se clicares em Não, continuarás a ver anúncios não personalizados. Para remover todos os anúncios, compra a versão sem anúncios [httpstore]aqui[]. Se comprares esta versão, os teus amigos também não terão anúncios quando organizas partidas! Para mais informações sobre as nossas práticas de privacidade e dos nossos parceiros de publicidade, consulta a nossa [https://www.innersloth.com/ptpt/privacy-policy-pt/]Política de privacidade[]. Podes alterar a tua decisão quando quiseres, no menu de definições em ''Dados''.",
