        [StringName.StarDisclaimer]: "Compra Estrelas do Among Us e desbloqueia um universo de personalizações! Gasta Estrelas na loja do jogo e obtém Cosmicubos e cosméticos exclusivos. As Estrelas compradas nesta plataforma não podem ser resgatadas ou usadas na PlayStation® ou Nintendo Switch™.",
