        [StringName.ItchNoStars]: "Infelizmente, não podes comprar Estrelas no itch.io. No entanto, se vinculares a tua conta itch.io a outra plataforma (i.e. outras versões para PC) podes comprar e aceder a Estrelas através dela! Nota: as Estrelas compradas na Nintendo Switch™ não são multiplataforma, por isso não podem ser resgatadas noutra plataforma.",
