        [StringName.ScientistBlurb]: "Verifica os sinais vitais a qualquer altura",
        [StringName.EngineerBlurb]: "Pode usar respiros",
        [StringName.GuardianAngelBlurb]: "Protege a tripulação sobrevivente",
        [StringName.ShapeshifterBlurb]: "Camufla-se.",
