        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Função de Tripulante: {0}",
            "ImpostorRole": "Função de Impostor: {0}",
            "Scientist_01": "O Cientista pode aceder onde quiser ao painel dos vitais portátil para ver o estado da tripulação.",
            "Scientist_02": "No entanto, o painel precisa de bateria, por isso o Cientista tem de concluir tarefas para a carregar.",
            "Engineer_01": "O Engenheiro é um Tripulante que pode usar os respiros para se mover mais rápido ou para apanhar Impostores em flagrante.",
            "Engineer_02": "Não podes ficar lá para sempre, para além de ser muito suspeito, por isso cuidado com quem anda por perto...",
            "GuardianAngel_01": "O Anjo da Guarda é o fantasma de um Tripulante. Ele protege-te e a outros Tripulantes vivos temporariamente com um escudo.",
            "GuardianAngel_02": "Utiliza-o no momento certo para evitares que os Impostores eliminem a sua vítima. Que sorte!",
            "Shapeshifter_01": "O Metamorfo altera a sua aparência e disfarça-se de outros Tripulantes. Se conseguires, podes incriminar outros Tripulantes e gerar confusão sobre quem é o verdadeiro Impostor.",
            "Shapeshifter_02": "Mas cuidado, o disfarce não dura para sempre e deixa pistas.",
            "Noisemaker_01": "Os Barulhentos não são uma função de tripulante normal. Ao contrário de todas as outras funções, não têm uma habilidade para usar. Em vez disso, enviam automaticamente um alerta quando são assassinados por um impostor.",
            "Noisemaker_02": "O alerta deixa imediatamente o impostor em pânico. Presta atenção aos tripulantes que correm para o local do crime para apanhares o assassino e vingares a tua morte!",
            "Tracker_01": "O Localizador pode ver a posição de um tripulante no seu minimapa, mas primeiro tem de estar perto do tripulante para lhe colocar o dispositivo de localização. Tem cuidado para não dares nas vistas quando te aproximares de outro tripulante.",
            "Tracker_02": "A localização só dura alguns segundos, por isso, escolhe bem o alvo. Além disso, não deixes que te apanhem a olhar para o minimapa em demasia, pois poderão achar que és um impostor!",
            "Phantom_01": "O Espetro pode ficar invisível e aparecer furtivamente junto de um tripulante ou abandonar o local do crime sem ser apanhado. Não pode matar enquanto estiver invisível, mas pode utilizar escadas e tirolesas.",
            "Phantom_02": "Ficar invisível e vice-versa cria uma grande nuvem de fumo, por isso, certifica-te de que não há tripulantes na área! A invisibilidade não dura para sempre; usa-a no momento certo!",
            "Detective_01": "O Detetive é um Tripulante especialista em resolver homicídios! Nas suas Notas, pode registar informações importantes sobre cada homicídio.",
            "Detective_02": "Depois, o Detetive pode interrogar outros Tripulantes para saber onde estavam no momento do crime. Junta as pistas e descobre quem é o assassino!",
            "Viper_01": "A Víbora usa um ácido letal para matar os Tripulantes. Os corpos dissolvem-se lentamente em três fases antes de desaparecerem totalmente.",
            "Viper_02": "Uma Víbora astuta garante que nenhum dos seus homicídios é descoberto. Usa as sabotagens ao máximo a teu favor!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "As funções dão um toque de engodo e estratégia ao jogo clássico!",
            "02": "Tanto os Tripulantes como os Impostores podem ter funções atribuídas aleatoriamente, dependendo das definições do jogo escolhidas pelo anfitrião."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "As funções são personalizáveis! Os anfitriões do jogo podem escolher quantas vezes um Engenheiro pode usar os respiros, o tempo de reativação do Metamorfo, etc. Também podem escolher a percentagem de probabilidade de uma destas funções ocorrer no jogo. Podes sempre ver se uma função está ativada nas definições da sala de espera do jogo!",
            "02": "Explora estas definições para criares a sala de espera perfeita, ou junta-te a uma e vê o caos que podes causar lá. Podemos adicionar novas funções ao jogo, por isso, volta aqui sempre que precisares Diverte-te!"
        },
