        [StringName.AccountDeleteHelp]: "Ao clicar em CONFIRMAR, estás a solicitar a eliminação de todos os teus dados do Among Us. Este pedido vai demorar 7 a 14 dias e irá resultar na eliminação de todas as Estrelas, EXP, Feijões, Pods e Cosméticos comprados. Depois de a tua conta ser completamente eliminada, não poderemos reverter esta ação. A tua conta irá funcionar normalmente até à conclusão do processo de eliminação.\n\nSe encontrares algum erro, contacta  support@innersloth.com.",
