        [StringName.TagFiltersHelpFindGame]: "Je kunt spelzoekopdrachten filteren door tags te selecteren in de vervolgkeuzelijst Filters. Filters die je selecteert, komen <i>exact</i> overeen met de zoekresultaten.\n\nVoorbeeld: Als je <b>Casual</b> en <b>Expert</b> selecteert, vind je alleen spellen die zijn getagd met zowel <b>Casual</b>- als <b>Expert</b>-filters.",
        [StringName.TagFiltersHelpCreate]: "Je kunt je spel taggen met filters om spelers te helpen je spel te vinden. Filters die je selecteert, komen <i>exact</i> overeen met de zoekresultaten.\n\nVoorbeeld: Als je <b>Casual</b> en <b>Expert</b> selecteert, is je spel alleen zichtbaar voor mensen die zoeken naar zowel <b>Casual</b>- als <b>Expert</b>-filters.",
        [StringName.CreateLabel]: "Criar",
        [StringName.NewGameMode]: "Novo modo de jogo!",
        [StringName.NewModeInfo]: "O risco é elevado neste modo de jogo emocionante! \n<i>Mas calma, não é um jogo de Escondidas habitual...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "É simples!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Tripulantes!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Impostores!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Tripulantes:</b></color> completam tarefas para acelerar o relógio, evitam o Impostor e permanecem vivos até o temporizador chegar ao zero.\n\n<color=#FF3131><b>O Impostor:</b></color> encontra os Tripulantes e assassina-os a todos.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Neste modo não há deduções sociais, apenas gritos apavorantes.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Esconde-te nos melhores sítios e usa a tua furtividade para sobreviveres.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "Neste modo podes usar respiros e um Medidor de Perigo de alta tecnologia que te alerta sempre que o Impostor se estiver a aproximar. O Impostor tem um campo de visão limitado, pelo que deves usar a tua astúcia, os respiros e visores para fugires dele!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Os Impostores não podem usar os respiros neste modo, por isso, terás de agir rapidamente para apanhares a tua presa. Está muito escuro! Felizmente, tens uma Lanterna para te ajudar a encontrar as tuas próximas vítimas.",
        [StringName.HideSeekHowToPlayFinalHide]: "É a contageeeeeem decrescenteeeeee. Nos últimos momentos do jogo, o Impostor recebe um reforço de poder: ganha mais velocidade, um mapa de Procura especial e um ping direcional que indica onde estão os Tripulantes sobreviventes.\n\nPensa depressa e foge estrategicamente para venceres!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Usa a Lanterna no lado direito do ecrã para direcionares o teu feixe e matares todos os Tripulantes que encontrares!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Usa o rato para direcionares o feixe da tua Lanterna e matares todos os Tripulantes que encontrares!",
