        [StringName.NoisemakerBlurbLong]: "Os Barulhentos não são uma função de tripulante normal. Ao contrário de todas as outras funções, não têm uma habilidade para usar. Em vez disso, enviam automaticamente um alerta quando são assassinados por um impostor. O alerta deixa imediatamente o impostor em pânico. Presta atenção aos tripulantes que correm para o local do crime para apanhares o assassino e vingares a tua morte!",
