        [StringName.HowToPlayText42]: "먼저 누구와 함께 플레이할지 정하세요!\n\n친구와 온라인으로 플레이하고 싶다면 \"비공개\"로 설정한 후 방 코드를 공유하면 됩니다.\n\n전 세계 곳곳의 플레이어와 플레이하고 싶다면 \"공개\"로 설정하세요.",
        [StringName.HowToPlayText43]: "임무의 수를 더 늘리고 싶으신가요? 이동 속도를 더 빠르게 하는 건 어때요? 임포스터를 늘리는 건요? 주최자는 이러한 설정을 변경할 수 있습니다. 동료 플레이어에게 변경 사항을 꼭 알리세요.",
        [StringName.HowToPlayText44]: "특정 누군가가 무례하게 굴거나 스패밍하는 경우, 주최자는 경고의 의미로 해당 플레이어를 일시적으로 추방하거나 특정 온라인 방에서 차단할 수 있습니다.",
