        [StringName.HowToPlayTextImp5]: "함선에 방해 공작을 일으켜 크루원 사이에 혼란을 일으키세요.",
        [StringName.HowToPlayTextImp6]: "문을 닫아 피해자를 가두세요.",
        [StringName.HowToPlayTextImp7]: "쿨다운 사이에 크루원을 처치하세요.",
        [StringName.HowToPlayText5]: "크루원과 임포스터 사이 공정한 게임을 위해 플레이 중에는 대화가 허용되지 않습니다.\n\n임포스터에게 처치된 플레이어는 게임이 끝날 때까지 말을 할 수 없습니다.\n\n유령은 크루원의 승리를 돕기 위해 할당된 임무를 계속 수행할 수 있습니다.",
        [StringName.HowToPlayText6]: "누군가 시체를 발견했다고 신고하거나 긴급회의를 소집한 경우, 크루원이 모여서 임포스터가 누구인지에 대해 논의할 수 있습니다.\n\n이때 플레이어는 임포스터가 누구라고 생각하는지, 자신이 어떤 정보를 갖고 있는지 자유롭게 이야기할 수 있습니다. 유령은 임포스터가 누구인지 이미 알고 있으므로 말할 수 없습니다.\n\n임포스터는 자신이 무죄임을 다른 사람이 믿게 하도록 속이거나, 다른 크루원에게 혐의를 씌울 수 있습니다.",
        [StringName.HowToPlayText7]: "회의가 끝나면 임포스터라고 생각한 사람에게 투표하세요.\n\n가장 많은 표를 받은 플레이어는 함선에서 방출되므로, 현명하게 선택해야 합니다!\n\n크루원으로서 정보가 부족한 경우, 무고한 플레이어를 방출하지 않고 더 많은 정보를 수집할 수 있도록 투표를 건너뛸 수 있습니다.",
        [StringName.HowToPlayText81]: "연습 모드에서 연습해보세요!",
        [StringName.HowToPlayText82]: "크루원이 되어 직접 임무를 설정하거나, 임포스터로서 처치 전략을 연습하세요!",
