        [StringName.LocalHelp]: "연결 문제가 발생했나요?\n\n● 모두가 같은 Wi-Fi 이름에 연결되어 있는지 확인하세요.\n● 모두가 같은 버전을 보유하고 있는지 확인하세요(오른쪽 하단에서 확인 가능).\n● Wi-Fi 신호가 강한지 확인하세요.\n● 다른 사람이 주최하면 문제가 해결될 수도 있습니다.\n● 앱을 재시작하면 도움이 될 때도 있죠...\n● 휴대폰을 재시작해서 해결되는 경우도 있고요...\n● 여전히 문제가 발생하나요? support@innersloth.com을 통해 알려주세요!",
        [StringName.OnlineHelp]: "어떻게 이용하나요?\n\n● 게임을 주최하면 로비 패널에서 게임 코드를 받을 수 있습니다.\n● 친구에게 게임 코드를 공유해 비공개 방을 만드세요.\n● \"비공개\"를 탭하면 다른 사람이 \"게임 찾기\"로 찾을 수 있는 공개 방을 만들 수 있습니다.\n● 주최자는 채팅이 가능한 곳에서 플레이어를 차단하거나 추방할 수 있습니다.\n● 여전히 문제가 발생하나요? support@innersloth.com을 통해 알려주세요!",
        [StringName.EmergencyCount]: "{0} 크루원님의 긴급회의가 \n\n\n\n회 남아 있습니다.",
        [StringName.EmergencyNotReady]: "크루원은 다음 긴급회의를 소집하기까지\n\n\n\n기다려야 합니다.",
        [StringName.EmergencyDuringCrisis]: "위기 상황에서는\n긴급회의를 소집할 수 없습니다.",
        [StringName.EmergencyRequested]: "긴급회의 요청됨\n주최자를 기다리는 중",
        [StringName.AdPolicyTitle]: "광고 정책",
        [StringName.AdPolicyText]: "맞춤형 광고를 위해 개인 데이터를 사용할까요? '예'를 클릭하면 Google AdMob 및 Unity Ads 등의 광고 파트너가 자동으로 데이터를 수집하며 맞춤형 광고를 위해 기기 ID와 쿠키를 사용합니다. '아니요'를 클릭하더라도 비 맞춤형 광고는 계속 볼 수 있습니다. 모든 광고를 제거하려면 광고 제외 업그레이드를 [httpstore]여기[]에서 구매하세요. 내가 호스트할 때마다 본인과 본인 친구가 광고를 받지 않습니다! 저희와 저희의 광고 파트너의 개인정보 처리 방법을 자세히 확인하려면 [https://www.innersloth.com/ko/privacy-policy-korean/]개인정보 처리방침[]을 확인하세요. 설정 메뉴의 \"데이터\"에서 언제든 결정을 변경할 수 있습니다.",
