        "RolesHelpOutro": {
            "default": "undefined",
            "01": "역할을 맞춤 설정할 수 있습니다! 게임 주최자는 엔지니어의 최대 환풍구 이용 횟수, 형상 변환 재사용 대기시간 등을 선택할 수 있습니다. 또한 게임에서 이러한 역할 중 하나가 나타날 확률도 선택할 수 있습니다. 게임 로비 설정에서 역할이 켜져 있는지 항상 확인할 수 있습니다!",
            "02": "가장 마음에 드는 설정으로 최고의 로비를 만들거나, 로비에 참여하여 어떤 혼란을 일으킬 수 있을지 확인해 보세요. 앞으로도 새로운 역할을 계속 추가할 수 있으니, 궁금하면 언제든 여기서 확인할 수 있어요. 즐겁게 플레이하세요!"
        },
