        [StringName.TagFiltersHelpCreate]: "게임에 필터 태그를 적용해 플레이어가 게임을 찾을 수 있도록 도움을 줄 수 있습니다. 선택한 필터는 검색 결과에 <i>정확</i>하게 적용됩니다.\n\n예: <b>캐주얼</b>과 <b>전문가</b>를 선택하면 <b>캐주얼</b>과 <b>전문가</b> 필터 2개를 모두 선택한 플레이어만 해당 게임을 볼 수 있습니다.",
        [StringName.CreateLabel]: "만들기",
        [StringName.NewGameMode]: "새로운 게임 모드!",
        [StringName.NewModeInfo]: "심장이 멎을 듯 위험한 게임 모드입니다! \n<i>기다려보세요. 평범한 숨바꼭질이 아니니까요...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "단순하죠!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "크루원입니다!",
        [StringName.HideSeekHowToPlayCaptionThree]: "임포스터입니다!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>크루원:</b></color> 임무를 완료해 시간을 빨리 가게 하고, 임포스터를 피하고, 타이머가 끝날 때까지 생존하세요.\n\n<color=#FF3131><b>임포스터:</b></color> 크루원을 찾아내 연쇄적으로 처치하세요.",
        [StringName.HideSeekHowToPlaySubtextOne]: "여기는 사회적 추론 따위는 없습니다. 그저 공포에 찬 비명만이 들릴 뿐이죠.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "생존을 위해 숨는 스킬을 발전시키세요.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "이 모드에서는 환풍구와 임포스터가 가까이 오면 알려주는 위험 측정기를 사용할 수 있습니다. 임포스터는 시야가 제한되어 있으므로 기지를 발휘해 환풍구, 바이저를 활용하여 피하세요!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "임포스터는 이 모드에서 환풍구를 이용할 수 없으므로 사냥감을 잡으려면 빨리 움직여야 합니다. 밖은 어둡죠! 다행히 다음 희생자를 찾는 데 도움이 될 손전등을 사용할 수 있습니다.",
        [StringName.HideSeekHowToPlayFinalHide]: "마지막 카운트다운입니다. 게임의 종반부에서 임포스터는 파워 부스트를 받습니다. 속도가 빨라지고, 특별한 술래 맵을 획득하며, 생존한 크루원이 어디 있는지 방향 핑을 받죠.\n\n빠르게 생각해 전략적으로 도망쳐 승리하세요!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "화면 오른쪽의 가상 조이스틱을 사용해 빛을 어느 방향으로 비출지 결정하고 찾아낸 크루원을 모두 처치하세요!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "마우스를 사용해 손전등 빛의 방향을 정하고 찾아낸 크루원을 모두 처치하세요!",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "오른쪽 스틱을 사용해 손전등 빛의 방향을 정하고 찾아낸 크루원을 모두 처치하세요!",
