        [StringName.HowToPlayText1]: "Among Us — игра о командной работе и предательстве,\nгде игроки получают роль члена экипажа или предателя.",
        [StringName.HowToPlayText2]: "Можно играть онлайн или по локальной беспроводной сети в команде от 4 до 15 человек!",
        [StringName.HowToPlayText41]: "При создании игры можно установить собственные правила.",
        [StringName.HowToPlayText42]: "Сначала выберите, с кем хотите сыграть!\n\nЕсли хотите играть с друзьями, создайте частную комнату и поделитесь с ними кодом.\n\nЧтобы сыграть со случайными игроками, сделайте комнату общей.",
        [StringName.HowToPlayText43]: "Вам не хватает заданий? Или хочется бегать побыстрее? А может быть, нужно больше предателей? Создавая комнату, владелец может настроить игру по своему вкусу. Только не забудьте обсудить это с остальными!",
        [StringName.HowToPlayText44]: "Владелец может выгнать игроков за грубое поведение или спам в чате либо полностью их заблокировать для своей онлайн-комнаты.",
        [StringName.HowToPlayTextMap]: "У каждого игрока есть личная карта, которая поможет ориентироваться на корабле.",
        [StringName.HowToPlayTextCrew1]: "Цель: заполнить шкалу заданий или вычислить предателя.",
        [StringName.HowToPlayTextCrew2]: "Заполняйте шкалу, выполняя задания.",
        [StringName.HowToPlayTextCrew3]: "Устраняйте последствия саботажа.",
        [StringName.HowToPlayTextCrew4]: "Вычиcлили предателя? Созывайте собрание!",
        [StringName.HowToPlayTextCrew5]: "Сообщайте о найденных трупах.",
        [StringName.HowToPlayTextCrew6]: "Комнаты админа и охраны помогут засечь подозрительные действия.",
        [StringName.HowToPlayTextImp1]: "Ваша цель: убить всех членов экипажа.",
        [StringName.HowToPlayTextImp2]: "Смешивайтесь с толпой.",
        [StringName.HowToPlayTextImp3]: "Пробирайтесь по вентиляции.",
        [StringName.HowToPlayTextImp4]: "Притворяйтесь, что выполняете задания.",
        [StringName.HowToPlayTextImp5]: "Занимайтесь саботажем и запутывайте других.",
        [StringName.HowToPlayTextImp6]: "Блокируйте двери и готовьте засады.",
        [StringName.HowToPlayTextImp7]: "Убивайте по окончании перезарядки.",
        [StringName.HowToPlayText5]: "Играете вместе? Никаких разговоров! Игра должна быть честной.\n\nИгроки, убитые предателем, молчат до конца игры.\n\nПризраки по-прежнему могут выполнять задания, чтобы помочь команде победить.",
        [StringName.HowToPlayText6]: "Если кто-то сообщил о трупе или созвал срочное собрание, команда пытается вычислить предателя.\n\nТеперь игроки могут открыто предполагать, кто предатель, и делиться наблюдениями. Если вы играете вместе, призраки должны молчать, поскольку им точно известно, кто предатель.\n\nПредатели попытаются доказать свою невиновность или перевести подозрения на другого игрока.",
        [StringName.HowToPlayText7]: "После обсуждения проголосуйте за игрока, которого вы считаете предателем.\n\nИгрок, набравший большинство голосов, будет выброшен, так что хорошо обдумайте свое решение!\n\nЕсли имеющихся у вас сведений недостаточно, можно пропустить голосование, чтобы не выбросить невиновного и собрать больше информации.",
        [StringName.HowToPlayText81]: "Практикуйтесь в режиме тренировки!",
        [StringName.HowToPlayText82]: "Подберите себе задания, сыграв за члена экипажа, или отточите навыки убийства в роли предателя.",
