        [StringName.LocalHelp]: "Проблемы с соединением?\n\n● Убедитесь, что все игроки подключены к одной точке доступа Wi-Fi.\n● Убедитесь, что у всех игроков установлена одна и та же версия игры (указана в правом нижнем углу).\n● Убедитесь, что сигнал Wi-Fi стабилен.\n● Попробуйте сменить владельца создаваемой игры.\n● Попробуйте перезапустить приложение.\n● Попробуйте перезапустить устройство.\n● Не получилось решить проблему? Напишите нам по адресу support@innersloth.com!",
        [StringName.OnlineHelp]: "Как все устроено?\n\n● После создания игры вы увидите код на панели лобби.\n● Поделитесь кодом с друзьями для создания частной комнаты.\n● Нажмите «Частная», если хотите сделать комнату открытой для поиска другими игроками.\n● Владелец может выгнать или заблокировать любого игрока, если доступен чат.\n● Остались вопросы? Напишите нам по адресу support@innersloth.com!",
