        [StringName.AdPolicyTitle]: "Рекламная политика",
        [StringName.AdPolicyText]: "Разрешите нам использовать ваши данные для подбора персонализированной рекламы. Если вы выберете «Да», наши партнеры Google AdMob и Unity Ads начнут автоматически собирать данные и использовать идентификаторы устройств и файлы cookie для подбора рекламы, соответствующей вашим интересам. Если нажать «Нет», вы все равно будете видеть стандартную рекламу. Можно также приобрести специальное обновление [httpstore]по этой ссылке[], и тогда в играх, владельцем которых вы являетесь, ни вы, ни ваши друзья рекламы видеть не будут! Чтобы узнать больше о практиках конфиденциальности наших партнеров по рекламе, см. нашу [https://www.innersloth.com/ru/privacy-policy-russian/]Политику конфиденциальности[]. Решение можно изменить в любой момент в разделе «Данные» меню настроек.",
