        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Роль члена экипажа: {0}",
            "ImpostorRole": "Роль предателя: {0}",
            "Scientist_01": "У учёного всегда есть доступ к переносной панели проверки пульса, позволяющей оценить состояние членов экипажа.",
            "Scientist_02": "Но ей необходима постоянная подзарядка, поэтому учёному нужно будет выполнять задания, чтобы заряжать батарею.",
            "Engineer_01": "Инженер — это член экипажа, который может использовать вентиляцию, чтобы быстрее передвигаться и ловить предателей прямо на месте преступления.",
            "Engineer_02": "Однако вечно оставаться в вентиляции нельзя, да и выглядело бы это слишком подозрительно. Так что следите за теми, кто находится рядом с вами…",
            "GuardianAngel_01": "Ангел-хранитель — это призрак погибшего члена экипажа. Он может временно защищать других живых членов экипажа.",
            "GuardianAngel_02": "Выберите верный момент для использования щита, и тогда вы сможете помешать предателям убить свою жертву. Счастливчики!",
            "Shapeshifter_01": "Оборотень может изменять свой внешний вид, маскируясь под других членов экипажа. Используйте эту способность с умом, чтобы подставлять других игроков и вносить сумятицу в поиски предателя!",
            "Shapeshifter_02": "Но будьте осторожны — маскировка не вечна. Кроме того, она оставляет за собой улики.",
            "Noisemaker_01": "Паникёр ― необычная роль члена экипажа. В отличие от всех остальных ролей он не может выполнить функцию \"Применить\". Зато, когда его убивает предатель, паникёр автоматически издаёт звуковой сигнал.",
            "Noisemaker_02": "От этого звука предатель легко впадает в панику. Наблюдайте, как ваши товарищи спешат на место преступления, чтобы схватить предателя и отомстить за вас!",
            "Tracker_01": "Следопыт может увидеть на своей миникарте местоположение любого члена экипажа. Соблюдайте осторожность, чтобы не выглядеть слишком подозрительно, приближаясь к другому члену экипажа. Ведь трекер можно установить только находясь вблизи объекта слежки.",
            "Tracker_02": "Слежка занимает всего несколько секунд, поэтому тщательно выбирайте цель. А еще не слишком долго смотрите на миникарту, иначе станете лёгкой добычей для предателя!",
            "Phantom_01": "Фантом может стать невидимкой, чтобы незаметно подобраться к члену экипажа или покинуть место преступления, не будучи пойманным. Убивать фантом-невидимка не может, однако трапы и зиплайны ― к его услугам.",
            "Phantom_02": "При превращении в невидимку или обратно, образуется большое облако дыма ― поэтому убедитесь, что поблизост нет никого из экипажа! И еще: правильно выбирайте момент для превращения. Ничто не длится вечно, даже невидимость.",
            "Detective_01": "Детектив — это член экипажа, который расследует убийства! Используя «Заметки», он может собирать важные сведения о каждом преступлении.",
            "Detective_02": "Детектив может допрашивать других членов экипажа, чтобы узнать, где они находились в момент убийства. Выясните, кто убийца!",
            "Viper_01": "Гадюка убивает членов экипажа кислотой. Тела жертв растворяются в три этапа, а потом полностью исчезают.",
            "Viper_02": "У умной Гадюки жертв не найти. Используйте саботаж на полную катушку!"
        },
