        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Члены экипажа:</b></color> выполняйте задания, чтобы ускорить время, избегайте предателя и постарайтесь выжить до конца раунда.\n\n<color=#FF3131><b>Предатель:</b></color> найдите членов экипажа и убейте их.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Кровь стынет в жилах. Дедукция здесь не поможет.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Выживут только те, кто отточит умение прятаться до идеала.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "В этом режиме вы можете прятаться в вентиляции, а также использовать высокотехнологичный измеритель уровня опасности, который предупредит о приближении предателя. Поле зрения предателя ограничено, так что действуйте хитро. Используйте вентиляцию и визоры, чтобы не попасться ему на глаза!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "В этом режиме предатели не могут попасть в вентиляционные отверстия, поэтому, чтобы поймать жертву, нужно действовать быстро. Кстати, там кромешная тьма! К счастью, у вас будет при себе фонарик.",
        [StringName.HideSeekHowToPlayFinalHide]: "Обрааатный отсчеееет. Когда время игры истекает, предатель получает усиление: он становится быстрее, получает карту поиска и подсказки в виде сигналов, указывающих, где находятся члены экипажа.\n\nПринимайте решения быстро и убегайте, чтобы победить!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Используйте виртуальный джойстик в правой части экрана, чтобы управлять фонариком и убивать всех членов экипажа, которых сможете найти!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Используйте мышь, чтобы управлять фонариком и убивать всех членов экипажа, которых сможете найти!",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Используйте правый мини-джойстик, чтобы управлять фонариком. Убивайте всех членов экипажа, которых сможете найти!",
        [StringName.HideSeekHowToPlayFlashlightPlayStation]: "Используйте правый джойстик, чтобы управлять фонариком. Убивайте всех членов экипажа, которых сможете найти!",
        [StringName.HideSeekHowToPlayFlashlightSwitch]: "Используйте правый мини-джойстик, чтобы управлять фонариком. Убивайте всех членов экипажа, которых сможете найти!",
