        [StringName.NoisemakerBlurbLong]: "Паникёр ― необычная роль члена экипажа. В отличие от всех остальных ролей он не может выполнить функцию \"Применить\". Зато, когда его убивает предатель, паникёр автоматически издаёт звуковой сигнал. От этого звука предатель легко впадает в панику. Наблюдайте, как ваши товарищи спешат на место преступления, чтобы схватить предателя и отомстить за вас!",
