        [StringName.PhantomBlurbLong]: "Фантом может стать невидимкой, чтобы незаметно подобраться к члену экипажа или покинуть место преступления, не будучи пойманным. Убивать фантом-невидимка не может, однако трапы и зиплайны ― к его услугам. При превращении в невидимку или обратно образуется большое облако дыма ― поэтому убедитесь, что поблизости нет никого из экипажа! И ещё: правильно выбирайте момент для превращения. Ничто не длится вечно, даже невидимость.",
