        [StringName.MeetingHasVoted]: "{0} heeft gestemd. Nog {1} te gaan.",
        [StringName.HowToPlayText1]: "Among Us gaat over teamwork en verraad.\n\nSpelers kunnen bemanningsleden zijn of een bedrieger.",
        [StringName.HowToPlayText2]: "Speel met 4 tot 15 spelers, online of via lokale wifi.",
        [StringName.HowToPlayText41]: "Als je een spel host, kun je instellen hoe het wordt gespeeld.",
        [StringName.HowToPlayText42]: "Bepaal eerst met wie je wilt spelen.\n\nAls je online met vrienden wilt spelen, kies je 'Privé' en deel je de kamercode.\n\nAls je met mensen van over de hele wereld wilt spelen, kies je 'Openbaar'.",
        [StringName.HowToPlayText43]: "Wil je met meer taken spelen? Of sneller lopen? Meer bedriegers? Als host kun je deze instellingen aanpassen. Zorg wel dat je de wijzigingen bevestigt bij je medespelers.",
        [StringName.HowToPlayText44]: "Als iemand onbeschoft doet en/of spam stuurt, kan de host die speler tijdelijk uit het spel gooien of helemaal uit de specifieke online kamer verbannen.",
        [StringName.HowToPlayTextMap]: "Spelers hebben een eigen kaart tot hun beschikking om de weg te vinden op het schip.",
        [StringName.HowToPlayTextCrew1]: "Doel: vul de gezamenlijke takenmeter of ontdek wie de bedrieger is.",
        [StringName.HowToPlayTextCrew2]: "Voltooi taken om de meter te vullen.",
        [StringName.HowToPlayTextCrew3]: "Reageer op sabotage van de bedrieger.",
        [StringName.HowToPlayTextCrew4]: "Bedrieger gevonden? Spoed vergadering!",
        [StringName.HowToPlayTextCrew5]: "Maak melding van lijken.",
        [StringName.HowToPlayTextCrew6]: "Zoek in Administratie en Beveiliging naar verdachte activiteiten.",
        [StringName.HowToPlayTextImp1]: "Doel: dood de bemanning.",
        [StringName.HowToPlayTextImp2]: "Meng je onder de bemanning.",
        [StringName.HowToPlayTextImp3]: "Sluip door de luchtschachten.",
        [StringName.HowToPlayTextImp4]: "Doe alsof je taken voltooit.",
        [StringName.HowToPlayTextImp5]: "Saboteer het schip en leid de bemanning om de tuin.",
        [StringName.HowToPlayTextImp6]: "Sluit deuren en lok slachtoffers in de val.",
        [StringName.HowToPlayTextImp7]: "Dood de bemanning tussen afkoelperiodes.",
        [StringName.HowToPlayText5]: "Als jullie samen fysiek in dezelfde ruimte spelen, mag er niet gepraat worden. Zo blijft het eerlijk voor de bemanning en de bedrieger.\n\nAls een speler gedood wordt door de bedrieger, mag die pas praten als het spel voorbij is.\n\nSpoken kunnen hun taken nog steeds uitvoeren om de bemanning naar de overwinning te helpen.",
        [StringName.HowToPlayText6]: "Als iemand een lijk meldt of een spoedvergadering bijeenroept, komt de bemanning bij elkaar om te bespreken wat ze weten over de bedrieger.\n\nSpelers kunnen nu openlijk praten over wie ze denken dat de bedrieger is en welke informatie ze hebben. Als je samen fysiek in dezelfde ruimte speelt, mogen de spoken niet praten, want zij weten al wie de bedrieger is.\n\nBedriegers zullen proberen hun onschuld te bewijzen of een ander bemanningslid te beschuldigen.",
        [StringName.HowToPlayText7]: "Na de bespreking stem je op wie volgens jou de bedrieger is.\n\nWie de meeste stemmen krijgt, wordt uit het schip gegooid, dus denk goed na over je stem!\n\nAls je niet genoeg informatie hebt, kun je als bemanning ook besluiten om niemand eruit te gooien en meer informatie te verzamelen.",
        [StringName.HowToPlayText81]: "Oefen in het speltype Oefenmodus!",
        [StringName.HowToPlayText82]: "Stel je eigen taken in als bemanningslid of oefen je moorddadige strategieën als bedrieger!",
