        [StringName.OnlineHelp]: "Hoe werkt dit?\n\n● Als je een spel host, krijg je een spelcode in het lobbypaneel.\n● Deel de spelcode met vrienden om een privékamer te maken.\n● Of tik op 'Privé' om de kamer openbaar te maken in 'Spel zoeken'.\n● De host kan spelers verbannen of verwijderen op momenten dat de chat beschikbaar is.\n● Lukt het nog steeds niet? Stuur ons dan een mail: support@innersloth.com!",
