        [StringName.AdPolicyTitle]: "Reclamebeleid",
        [StringName.AdPolicyText]: "Kunnen we je persoonlijke gegevens gebruiken om advertenties op je af te stemmen? Als je op ja klikt, verzamelen onze advertentiepartners zoals Google AdMob en Unity Ads automatisch gegevens en gebruiken ze apparaatkenmerken en cookies voor advertentiepersonalisering. Als je op nee klikt, zie je mogelijk nog steeds niet-gepersonaliseerde advertenties. Om alle advertenties te verwijderen, koop je [httpstore]hier[] de advertentieloze upgrade. Jij en je vrienden krijgen dan geen advertenties wanneer jij host! Zie ons [https://www.innersloth.com/nl/privacy-policy-nl/]privacybeleid[] voor meer informatie over de privacy-praktijken van ons en onze advertentiepartners. Je kunt je besluit altijd wijzigen in het instellingenmenu onder \"Data\".",
