        [StringName.ItchNoStars]: "Helaas kun je geen sterren kopen op itch.io. Maar als je je itch.io-account koppelt aan een ander platform (bijv. andere pc-versies), kun je daar sterren kopen en gebruiken! Opmerking: sterren die gekocht worden op een Nintendo Switch™ kunnen niet worden overgedragen naar een ander platform.",
