        [StringName.ScientistBlurb]: "Gebruik hartslag wanneer je wilt",
        [StringName.EngineerBlurb]: "Kan de luchtschachten gebruiken",
        [StringName.GuardianAngelBlurb]: "Bescherm de resterende bemanning",
