        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Rol bemanningslid: {0}",
            "ImpostorRole": "Rol bedrieger: {0}",
            "Scientist_01": "De Wetenschapper heeft overal toegang tot een draagbaar hartslagpaneel om de status van de bemanning te controleren.",
            "Scientist_02": "Het paneel moet echter worden opgeladen, dus de Wetenschapper moet taken voltooien om de batterij te vullen.",
            "Engineer_01": "De Werktuigkundige is een Bemanningslid dat luchtschachten kan gebruiken om zich sneller te verplaatsen en Bedriegers op heterdaad te betrappen.",
            "Engineer_02": "Je kunt er echter niet altijd blijven en het is vrij verdacht, dus kijk wie er in de buurt is als je de luchtschacht gebruikt...",
            "GuardianAngel_01": "De Beschermengel is de geest van een Bemanningslid. Deze kan andere levende Bemanningsleden tijdelijk beschermen.",
            "GuardianAngel_02": "Als je het goed timet, kun je voorkomen dat Bedriegers hun slachtoffer doden. Mazzel!",
            "Shapeshifter_01": "De Vormveranderaar kan zijn uiterlijk veranderen en zich vermommen als andere Bemanningsleden. Doe het goed om andere Bemanningsleden in de val te lokken en verwarring te zaaien over wie de echte Bedrieger is!",
            "Shapeshifter_02": "Maar pas op: de vermomming duurt niet eeuwig en laat bewijs achter.",
            "Noisemaker_01": "De Herriemaker is geen gewone rol voor bemanningsleden. Herriemakers hebben geen vaardigheid die ze kunnen gebruiken, zoals alle andere rollen. In plaats daarvan sturen ze automatisch een waarschuwing wanneer ze worden gedood door een bedrieger.",
            "Noisemaker_02": "De waarschuwing jaagt de bedrieger makkelijk op de kast. Kijk hoe je mede-bemanningsleden zich naar de plaats delict haasten om de moordenaar te pakken en je dood te wreken!",
            "Tracker_01": "Spoorzoekers kunnen de positie van een bemanningslid op hun minikaart zien. Eerst moeten ze naast een bemanningslid staan om de tracker te plaatsen. Pas op dat je niet te verdacht overkomt als je het andere bemanningslid nadert.",
            "Tracker_02": "Opsporen duurt maar een paar seconden, dus zorg ervoor dat je een doelwit zorgvuldig kiest. Staar ook niet te lang naar de minikaart, want dat maakt je kwetsbaar voor een bedrieger!",
            "Phantom_01": "De Fantoom kan onzichtbaar worden om een bemanningslid stiekem te besluipen of ongemerkt de plaats van een misdrijf te verlaten. Als Fantomen onzichtbaar zijn, kunnen ze niet doden, maar ze kunnen wel ladders en tokkelbanen gebruiken.",
            "Phantom_02": "Als je onzichtbaar of weer zichtbaar wordt, ontstaat er een grote rookwolk, dus zorg ervoor dat er geen bemanningsleden in de buurt zijn! De onzichtbaarheid is ook niet permanent, dus zorg ervoor dat je deze vaardigheid goed timet.",
            "Detective_01": "De Detective is een bemanningslid dat uitblinkt in het oplossen van moorden. Met hun aantekeningen kunnen zij belangrijke informatie over elke moord vastleggen.",
            "Detective_02": "De Detective kan vervolgens andere bemanningsleden ondervragen om te achterhalen waar zij zich op het moment van de moord bevonden. Leg de verbanden en ontmasker de dader!",
            "Viper_01": "De Adder gebruikt een dodelijk zuur om bemanningsleden te doden. Lichamen lossen langzaam op in drie fasen voordat ze volledig verdwijnen.",
            "Viper_02": "Een slimme Adder zorgt ervoor dat al hun slachtoffers nooit worden gevonden. Maak optimaal gebruik van sabotage!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Rollen voegen een gloednieuw niveau van bedrog en strategie toe aan het klassieke spel!",
            "02": "Zowel Bemanningsleden als Bedriegers kunnen willekeurig rollen toegewezen krijgen, afhankelijk van de spelinstellingen die door de host zijn gekozen."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Rollen zijn configureerbaar! Gamehosts kunnen kiezen hoe vaak een Werktuigkundige in luchtschachten kan kruipen, wat de afkoeltijd is voor de Vormveranderaar, enzovoort. Ze kunnen ook kiezen hoe groot de kans is dat een van deze rollen in het spel voorkomt. Je kunt altijd zien of een rol is ingeschakeld in de instellingen van de spel-lobby!",
            "02": "Speel met de instellingen die je het leukst vindt om je ultieme lobby te creëren, of sluit je aan bij een lobby en kijk welke chaos je daar kunt veroorzaken. We voegen mogelijk nieuwe rollen aan het spel toe, dus kom terug wanneer je maar wilt! Veel plezier!"
        },
