        [StringName.ProtectedRecently]: "De beschermengel heeft zojuist iemand beschermd...",
        [StringName.ScientistBlurbMed]: "Gebruik hartslag wanneer je wilt.\nVoltooi taken om je batterij op te laden.",
        [StringName.ScientistBlurbLong]: "De wetenschapper kan een draagbare hartslagmonitor gebruiken om de status van de bemanning te controleren. Maar de draagbare hartslagmonitor moet wel worden opgeladen, dus de wetenschapper moet taken voltooien om de batterij te vullen.",
        [StringName.EngineerBlurbMed]: "Kan de luchtschachten gebruiken.",
        [StringName.EngineerBlurbLong]: "De werktuigkundige is een bemanningslid dat luchtschachten kan gebruiken om zich sneller te verplaatsen, en bedriegers kan betrappen die de luchtschachten gebruiken. Maar je kunt er niet eeuwig blijven, dus let goed op wanneer je de luchtschachten gebruikt...",
        [StringName.GuardianAngelBlurbMed]: "Creëer een beschermend schild rond\nde resterende bemanning.",
        [StringName.GuardianAngelBlurbLong]: "De beschermengel is het spook van het eerste dode bemanningslid. Deze kan andere, levende bemanningsleden tijdelijk beschermen met een schild. Met de juiste timing kun je voorkomen dat bedriegers hun slachtoffer doden. Mazzel!",
        [StringName.ShapeshifterBlurbMed]: "Vermom jezelf door in andere bemanningsleden\nte veranderen.",
        [StringName.ShapeshifterBlurbLong]: "De vormveranderaar kan van gedaante verwanderen en zichzelf vermommen als een ander bemanningslid. Als je het goed doet, kun je andere bemanningsleden verdacht maken en verwarring veroorzaken over de identiteit van de echte bedrieger. Maar kijk uit, want de vermomming duurt niet eeuwig en laat bewijsmateriaal achter.",
