        [StringName.UserIdTokenError]: "Gebruikersverificatie verlopen. Start het spel opnieuw als dit probleem aanhoudt.",
        [StringName.AccountDeleteHelp]: "Door op BEVESTIGEN te drukken, dien je een verzoek in om al je Among Us-gegevens te verwijderen. Het kost 7-14 dagen om dit verzoek te verwerken, en alle sterren, XP, bonen, pods en gekochte cosmetische items worden verwijderd. Zodra je account volledig is verwijderd, kunnen we deze actie niet meer ongedaan maken. Je account werkt normaal totdat de verwijderingsprocedure is voltooid.\n\nAls je fouten tegenkomt, kun je contact opnemen met support@innersloth.com.",
        [StringName.DeleteAccount]: "Account verwijderen",
        [StringName.DoNotDeleteAccount]: "Verwijdering account annuleren",
        [StringName.AccountUnDeleteHelp]: "Door op BEVESTIGEN te drukken, stop je de procedure voor het verwijderen van je account. Als je het account wilt verwijderen, moet je het verzoek opnieuw indienen.\n\nAls je fouten tegenkomt, kun je contact opnemen met support@innersloth.com.",
