        [StringName.TagFiltersHelpFindGame]: "Je kunt spelzoekopdrachten filteren door tags te selecteren in de vervolgkeuzelijst Filters. Filters die je selecteert, komen <i>exact</i> overeen met de zoekresultaten.\n\nVoorbeeld: Als je <b>Casual</b> en <b>Expert</b> selecteert, vind je alleen spellen die zijn getagd met zowel <b>Casual</b>- als <b>Expert</b>-filters.",
        [StringName.TagFiltersHelpCreate]: "Je kunt je spel taggen met filters om spelers te helpen je spel te vinden. Filters die je selecteert, komen <i>exact</i> overeen met de zoekresultaten.\n\nVoorbeeld: Als je <b>Casual</b> en <b>Expert</b> selecteert, is je spel alleen zichtbaar voor mensen die zoeken naar zowel <b>Casual</b>- als <b>Expert</b>-filters.",
        [StringName.CreateLabel]: "Maken",
        [StringName.NewGameMode]: "Nieuwe spelmodus!",
        [StringName.NewModeInfo]: "Er staat veel op het spel in deze bloedstollende modus!\n<i>Maar wacht: dit is geen gewoon verstoppertje...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "Het is heel eenvoudig!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Bemanningsleden!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Bedriegers!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Bemanningsleden:</b></color> Voltooi taken om de klok te versnellen, de Bedrieger te ontwijken en in leven te blijven totdat de tijd om is.\n\n<color=#FF3131><b>De Bedrieger:</b></color> Vind de Bemanningsleden en moord iedereen uit.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Geen sociale deductie hier, alleen maar doodsbang geschreeuw.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Verbeter je verstop- en sluipvaardigheden om te overleven.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "In deze modus kun je luchtschachten gebruiken en een high-tech Gevaarmeter krijgen die je waarschuwt wanneer de Bedrieger dichterbij komt. De Bedrieger heeft een beperkt gezichtsveld, dus gebruik je verstand, luchtschachten en brillen om ze te ontwijken!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Bedriegers kunnen in deze modus niet in luchtschachten kruipen, dus je moet snel handelen om je prooi te vangen. Het is donker buiten! Gelukkig heb je een zaklamp om je volgende slachtoffers te vinden.",
        [StringName.HideSeekHowToPlayFinalHide]: "Dit is de finaaaal countdownnn. In de laatste momenten van het spel krijgen Bedriegers een krachtbonus: ze zijn sneller, krijgen een speciale Zoekkaart en een directionele ping naar de plek waarop overlevende Bemanningsleden zich bevinden.\n\nDenk snel en ren strategisch weg om te winnen!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Gebruik de Zaklamp-stick aan de rechterkant van je scherm om je straal te richten en dood alle Bemanningsleden die je kunt vinden!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Gebruik je muis om je Zaklampstraal te richten en dood alle Bemanningsleden die je kunt vinden!",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Gebruik de rechter-stick om je straal te richten en dood alle Bemanningsleden die je kunt vinden!",
