        [StringName.QCSelfSawRoleInLocation]: "Ik zag {0} op locatie {1}",
        [StringName.NoisemakerRole]: "Herriemaker",
        [StringName.NoisemakerBlurb]: "Stuur een waarschuwing als je wordt gedood",
        [StringName.NoisemakerBlurbMed]: "Waarschuw alle bemanningsleden over je locatie\nals je wordt gedood.",
        [StringName.NoisemakerBlurbLong]: "De Herriemaker is geen gewone rol voor bemanningsleden. Herriemakers hebben geen vaardigheid die ze kunnen gebruiken, zoals alle andere rollen. In plaats daarvan sturen ze automatisch een waarschuwing wanneer ze worden gedood door een bedrieger. De waarschuwing jaagt de bedrieger makkelijk op de kast. Kijk hoe je mede-bemanningsleden zich naar de plaats delict haasten om de moordenaar te pakken en je dood te wreken!",
