        [StringName.PhantomRole]: "Fantoom",
        [StringName.PhantomBlurb]: "Onzichtbaar worden",
        [StringName.PhantomBlurbMed]: "Word onzichtbaar om stiekem rond te sluipen\nof te ontsnappen van een moord.",
        [StringName.PhantomBlurbLong]: "De Fantoom kan onzichtbaar worden om een bemanningslid stiekem te besluipen of ongemerkt de plaats van een misdrijf te verlaten. Als Fantomen onzichtbaar zijn, kunnen ze niet doden, maar ze kunnen wel ladders en tokkelbanen gebruiken. Als je onzichtbaar of weer zichtbaar wordt, ontstaat er een grote rookwolk, dus zorg ervoor dat er geen bemanningsleden in de buurt zijn! De onzichtbaarheid is ook niet permanent, dus zorg ervoor dat je deze vaardigheid goed timet.",
