        [StringName.TrackerBlurbLong]: "Spoorzoekers kunnen de positie van een bemanningslid op hun minikaart zien. Eerst moeten ze naast een bemanningslid staan om de tracker te plaatsen. Pas op dat je niet te verdacht overkomt als je het andere bemanningslid nadert. Opsporen duurt maar een paar seconden, dus zorg ervoor dat je een doelwit zorgvuldig kiest. Staar ook niet te lang naar de minikaart, want dat maakt je kwetsbaar voor een bedrieger!",
