        [StringName.MeetingHasVoted]: "Miboto na si {0}. {1} na lamang ang nahibilin.",
        [StringName.HowToPlayText1]: "Ang Among Us usa ka dula sa pagtinabangay ug pagtraydor.\n\nAng mga player kay Mga Crewmate o Impostor.",
        [StringName.HowToPlayText2]: "Pakigdula sa 4 hangtud sa 15 ka player online o pinaagi sa lokal nga WiFi!",
        [StringName.HowToPlayText41]: "Kung mag-host og dula, aduna kay kontrol sa paagi sa pagdula.",
        [StringName.HowToPlayText42]: "Una, pilia kung kinsa ang gusto nimong makadula!\n\nKung gusto nimong makigdula sa mga higala online, itakda sa \"pribado\" ug i-share ang room code.\n\nKung gusto kang makigdula sa uban pang gikan sa tibuok kalibutan, itakda sa \"pampubliko\".",
        [StringName.HowToPlayText43]: "Gustong magdula nga daghan ang task? Gusto og mas paspas nga paglakaw? Dugang pang Impostor? Isip host, mabag-o nimo kini nga setting. Siguroha nga kumpirmahon ang kabag-ohan sa mga kauban nga player.",
        [StringName.HowToPlayText44]: "Kung adunay bastos ug/o nag-spam, mahimong temporaryong magtangtang ang host og mga player isip pasidaan o i-ban ang mga player sa partikular nga online room.",
        [StringName.HowToPlayTextMap]: "Adunay akses ang mga player sa personal nga mapa aron matabangan sila sa pag-navigate sa barko.",
        [StringName.HowToPlayTextCrew1]: "Katuyoan: Mapuno ang Task Bar sa Grupo o Madiskubre ang Impostor.",
        [StringName.HowToPlayTextCrew2]: "Kumpletoha ang task aron mapuno ang gauge.",
        [StringName.HowToPlayTextCrew3]: "Pag-react sa Sabotahe sa Impostor.",
        [StringName.HowToPlayTextCrew4]: "Pagtawag og emergency meeting kung makit-an na ang Impostor.",
        [StringName.HowToPlayTextCrew5]: "I-report ang mga patay nga lawas.",
        [StringName.HowToPlayTextCrew6]: "Susiha ang Mapa ug Seguridad sa Admin kung adunay kadudahang aktibidad.",
        [StringName.HowToPlayTextImp1]: "Katuyoan: Patyon ang Crew.",
        [StringName.HowToPlayTextImp2]: "Pakig-uban-uban sa Crew.",
        [StringName.HowToPlayTextImp3]: "Tago pinaagi sa mga vent.",
        [StringName.HowToPlayTextImp4]: "Pagpasumangil nga magbuhat og mga task.",
        [StringName.HowToPlayTextImp5]: "Isabotahe ang barko ug liboga ang Crew.",
        [StringName.HowToPlayTextImp6]: "Isirado ang pultahan ug ipriso ang biktima.",
        [StringName.HowToPlayTextImp7]: "Patya ang Crew sa panahon sa cooldown.",
        [StringName.HowToPlayText5]: "Samtang personal nga nagdula, wala gitugutan ang pag-istoryahay aron mapabiling patas ang dula taliwala sa Crew ug sa Impostor.\n\nKung mapatay sa Impostor ang usa ka player, dili sila mahimong mag-istoryahay hangtud nga matapos ang dula.\n\nBuhaton gihapon sa mga kalag ang ilang mga nakatakdang task aron posibleng modaog ang Mga Crewmate.",
        [StringName.HowToPlayText6]: "Kung adunay mag-report og patay nga lawas o motawag og emergency meeting, magtapok ang Crew aron hisgutan ang ilang nahibaluan mahitungod sa Impostor.\n\nMahimo na karong mag-istoryahay ang mga player mahitungod sa kung kinsa ang Impostor ug kung unsang impormasyon ang aduna sila. Kung personal nga magdula, dili mahimong moistorya ang Mga Kalag tungod kay nakahibalo na sila kung kinsa ang Impostor.\n\nMagsulay ang Mga Impostor sa pagpamatuod sa ilang pagkainosente o mag-akusa og laing miyembro sa crew.",
        [StringName.HowToPlayText7]: "Pagkahuman sa pakighisgot, muboto ka kung kinsa ang Impostor.\n\nI-eject sa barko ang makakuha sa pinakadaghang boto, mao nga taronga ang pagboto!\n\nKung wala kay igong impormasyon ug nagdesisyon ka isip Crew, mahimo nimong laktawan ang pagboto aron malikayan ang pag-eject og inosenteng tawo ug mangita og dugang impormasyon.",
        [StringName.HowToPlayText81]: "Pagbansay sa Praktis nga mode!",
        [StringName.HowToPlayText82]: "Pagtakda og imong mga kaugalingong task isip miyembro sa Crew o praktisa ang imong mga istratehiya sa pagpatay isip Impostor!",
