        [StringName.LocalHelp]: "Problema sa koneksyon?\n\n● Siguroha nga nakakonekta ang tanan sa parehong ngalan sa WiFi\n● Siguroha nga ang tanan adunay parehong bersyon (sa tuo nga bahin sa ubos)\n● Siguroha nga kusog ang signal sa imong WiFi\n● Usahay makatabang kung laing tawo ang mag-host\n● Usahay makatabang ang pag-restart sa app...\n● Usahay makatabang ang pag-restart sa imong telepono...\n● Aduna gihapoy mga problema? Pahibaloa mi pinaagi sa pagkontak sa support@innersloth.com!",
        [StringName.OnlineHelp]: "Unsaon paggana niini?\n\n● Ang pag-host og dula maghatag kanimo og code sa dula sa lobby panel.\n● I-share ang code sa dula sa mga higala aron makahimo og pribadong room.\n● O pindota ang \"Pribado\" aron himuong pampubliko ang room para sa \"Pangita og Dula\".\n● Mahimong mag-ban o magtangtang og player ang host kung available ang chat.\n● Aduna gihapoy problema? Pahibaloa mi pinaagi sa pagkontak sa support@iinersloth.com!",
        [StringName.EmergencyCount]: "ANG MIYEMBRO SA CREW NGA SI {0} ADUNA PAY NAHIBILIN NGA\n\n\n\nKA EMERGENCY MEETING",
