        [StringName.AdPolicyTitle]: "Palisiya sa Advertisement",
        [StringName.AdPolicyText]: "Pwede ba namong gamiton ang imong personal nga data aron ipahiuyon ang mga ad para nimo? Kung imong i-click ang oo, ang among mga partner sa pag-advertise sama sa Google AdMob ug Unity Ads awtomatikong magkolekta og data ug mogamit og mga device identifier ug mga ccokie para sa personalisasyon sa ad. Kung imong i-click ang dili, pwede gihapon kang makakita og mga ad mga wala gi-personalize. Aron tangtangon ang tanang mga ad, pagpalit og no-ad nga upgrade [httpstore]dinhi[], ug ikaw ug ang imong mga higala dili makakita og mga ad kung ikaw ang host! Aron makahibalo og dugang mahitungod sa mga practice sa pagkapribado namo ug sa among mga parter sa pag-advertise, palihug tan-awa ang among [https://www.innersloth.com/tl/privacy-policy-fil/]Palisiya sa Pagkapribado[]. Pwede nimong mausab ang imong desisyon bisan kanus-a sa menu sa mga setting ilalom sa \"Data\".",
