        [StringName.ConfirmUnlinkAccount]: "Kumpirmaha ang Pag-unlink sa Account",
        [StringName.UnlinkAccountExplain]: "Kung i-unlink ang imong {0} account , ma-wipe ang imong datos ug maghimo og bag-ong {0} account.\n- Mawala ang bisan unsang mga aytem nga imong nadawat o na-unlock sa imong {0} account.\n- Mag-restart ka sa lebel 1 ug 0 XP.",
        [StringName.UnlinkAccountExplainConfirm]: "Palihug i-save kini nga ID para sa reperensya:\n\n{0}\n\nKung i-unlink nimo ang imong account ug wala ka niini nga ID, dili namo ma-recover ang imong progreso ug dili ka matabangan kung adunay sayop.",
