        [StringName.ConfirmLinkExistingAccount]: "Kumpirmaha ang Pag-link sa Kasamtangang Account",
        [StringName.LinkExistingAccountExplain]: "Kung mag-link sa laing account, ma-overwrite ang tanang datos niini nga platform. Nagpasabot kini nga pulihan sa laing account ang imong {0} Among Us account.\n- Ma-overwrite ang bisan unsang mga aytem nga imong na-unlock sa imong{0} account.\n- Ma-overwrite ang tanang XP nga nakuha sa imong{0} account.\n- Ma-overwrite ang tanang mga Bean, Pod, ug Star.",
        [StringName.LinkExistingAccountExplainConfirm]: "Sa labing daling panahon nga magkumpirma ka, i-reset namo ang imong {0} Among Us account aron mag-andam para sa pag-import sa datos gikan sa laing account.\n\n<color=#{1}>SIGUROHA NGA ADUNA KAY LAING KASAMTANGANG ACCOUNT DIIN GUSTO NIMONG I-LINK KINI NGA ACCOUNT SA DILI  PA IPROSESO.</color>\n\nKung i-reset ang imong {0} account, mapapas ang tanang XP, Bean, Pod, ug mga aytem ug mahimong 0. DILI namo ma-revert kini nga aksyon.",
