        [StringName.StarDisclaimer]: "Palit og ka Stars sa Among Us aron i-unlock ang usa ka bag-ong galaksiya sa customization! Igasto ang mga Stars sa in-game store aron makakuha og eksklusibong mga kosmetiko ug talagsaong Cosmicubes. Ang tanang Stars nga gipalit dinhi dili ma-redeem o magamit sa PlayStation®, o Nintendo Switch™.",
