        [StringName.ItchNoStars]: "Ikasubo, dili available ang pagpalit og Stars sa itch.io. Bisan pa, ang pag-link sa imong itch.io nga account ngadto sa laing plataporma (pananglit, ubang bersyon sa PC) magtugot nimo nga makapalit ug maka-access sa Stars gikan didto! Matikdi: Ang Stars nga gipalit sa Nintendo Switch™ dili crossplatform, mao nga dili ma-redeem sa bisan unsang laing plataporma.",
