        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Role sa Crewmate: {0}",
            "ImpostorRole": "Role sa Impostor: {0}",
            "Scientist_01": "Ang Scientist maka-access sa usa ka portable vitals panel bisan asa aron masusi ang kahimtang sa mga crew.",
            "Scientist_02": "Bisan pa man, kinahanglang ma-charge ang panel, maong kinahanglang makompleto sa Scientist ang mga task aron mapuno ang baterya.",
            "Engineer_01": "Ang Engineer mao ang Crewmate nga makagamit sa mga vent aron mas paspas nga makalihok, aron pud sa pagdakop sa mga Impostor nga nag-vent sa akto.",
            "Engineer_02": "Apan dili ka puwedeng magpabilin didto hangtod sa hangtod ug makaduda kini kaayo, busa pag-amping kung kinsa ang imong i-vent sa palibot...",
            "GuardianAngel_01": "Ang Guardian Angel mao ang kalag sa usa ka Crewmate. Mahimo nilang temporaryong panalipdan ug protektahan ang ubang buhi nga mga Crewmate.",
            "GuardianAngel_02": "Orasi kini og maayo ug mapugngan nimo ang mga Impostor sa pagpatay sa ilang mga biktima. Swerte!",
            "Shapeshifter_01": "Ang Shapeshifter maka-usab sa ilang panagway ug maka-disguise sa ilang kaugalingon ingong ubang mga Crewmate. Taronga kini og himo aron ma-frame ang ubang mga Crewmate ug makahimo og kalibog kung kinsa ang tinuod nga Impostor.",
            "Shapeshifter_02": "Pero pagbantay - ang disguise dili magdugay ug magbilin og ebidensya.",
            "Noisemaker_01": "Dili ordinaryong role sa crewmate ang Noisemaker. Wala silay abilidad nga magamit sama sa tanang uban nga role. Hinuon, awtomatiko nga magpadala sila og alerto kung mapatay sila sa impostor.",
            "Noisemaker_02": "Makapataranta og dali sa impostor ang alerto. Tan-awa imong mga kauban nga crewmate nga magdali og adto sa eksena sa krimen aron dakpon ang killer ug panimaslan imong kamatayon!",
            "Tracker_01": "Makita sa Tracker ang posisyon sa crewmate sa ilang minimap. Kinahanglan una nga motapad sila sa laing crewmate aron mabutang ang tracking device. Pagbantay nga dili kaayo ka makaduda tan-awon samtang duolan ang ubang crewmate.",
            "Tracker_02": "Molungtad lang og pipila ka segundo ang pag-track mao nga siguroha ang pagpili og maayo sa target. Dugang pa, ayaw palabi'g tan-aw og dugay sa minimap kay dali ra ka maduolan sa impostor ana!",
            "Phantom_01": "Mahimo nga invisible ang Phantom aron makatago sa crewmate o makabiya sa eksena sa krimen nga dil madakpan. Dili sila makapatay samtang invisible, pero makagamit gihapon sila og mga hagdanan ug zipline.",
            "Phantom_02": "Ang pagkahimong invisible ug dili invisible maghimo og dako nga aso nga panganod maong siguroha nga walay crewmate sa area! Dili sab hangtod sa hangtod ang pagka-invisible mao nga siguroha nga ma-timing og sakto ang abilidad.",
            "Detective_01": "Ang Detective usa ka Crewmate nga mulabaw sa pagsulbad ug mga pagpatay! Kauban ang ilang Sulatanan, makahimo sila ug record sa mga importanteng info kabahin sa kada pagpatay.",
            "Detective_02": "Ang Detetive makahimo unya ug Pagsukit sa laing mga Crewmates para makabalo ug asa sila nga lugar sa oras sa pagpatay. Isumpay ang mga tuldok ug pangitaon ang mamumuno.",
            "Viper_01": "Ang Viper nag gamit ug makapatay nnga asido para mupatay ug Crewmates. Mga lawas nga hinay-hinay natunaw sa tulo ka yugto bag-o hingpit nga mawala.",
            "Viper_02": "Ang maalamon nga Viper nagsiguro nga tanan nilang gipatay dili gayud makit-an. Gamit ug sabotahe sa imong maximum nga bintaha."
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Magdugang ang mga role og bag-ong lebel sa paglimbong ug estratehiya sa klasiko nga dula!",
            "02": "Ang Mga Crewmate ug Impostor mahimong adunay mga role nga gi-assign kanila nga random, depende sa mga setting sa dula nga gipili sa host."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Ma-customize ang mga role! Ang mga host sa dula mahimong makapili kung pila ka beses ang Engineer maka-vent, pag-cooldown sa Shapeshifter, ug uban pa. Mahimo usab nila pilion ang porsyento sa higayon sa usa niini nga mga papel nga mahitabo sa dula. Kanunay nimong makita kung ang usa ka papel gi-on sa mga setting sa lobby sa dula!",
            "02": "Sulayi og maayo ang mga setting nga hilabihang gusto nimo aron mahimo ang imong katapusang lobby, o apil sa usa ug tan-awa kung unsa nga kagubot ang mahimo nimong ipahinabo didto. Mahimong magdugang mi og mga bag-ong mga role sa dula, busa balik dinhi kung kinahanglan nimo! Paglingaw!"
        },
