        [StringName.GuardianAngelBlurbLong]: "Ang Guardian Angel mao ang ghost sa unang namatay nga Crewmate. Sila temporaryong maka-shield ug makapanalipod sa ubang buhing mga Crewmate. Orasi kini og maayo ug mapugngan nimo ang mga Impostor sa pagpatay sa ilang mga biktima. Swerte!",
