        [StringName.SettingsColorblind]: "Colorblind Text",
        [StringName.MergeGuestAccountText]: "Murag dunay <link=\"https://www.innersloth.com/merging-guest-accounts/\">guest account</link> niini nga device! Wala na namo gisuportahan ang mga guest account ug mag-merge sa tanang mga item, currency, ug kasinatian gikan sa imong guest account ngadto niining {0} account.\n\nKung naggamit ka niini nga device (computer, phone, ubp.) uban ang laing mga tawo, palihug matikdi nga ang tanan nga mogamit niini nga device MAG-SHARE niini nga guest account. Walay laing mga user niini nga device ang maka-merge niining guest account kung mopadayon ka, ug KAUSA lang ka maka-merge niining guest account. DILI ka maka-reallocate pag-usab sa mga item, currency, ug kasinatian nga nalangkit niining guest acccount.\n\nPalihug ikumpirma nga gusto nimong i-merge ang imong guest account ngadto niining {0} account.",
