        [StringName.UserIdTokenError]: "Na-expire na ang Pagpamatuod sa User. Palihug i-restart ang dula kung magpadayon pa kini.",
        [StringName.AccountDeleteHelp]: "Pinaagi sa pagpindot sa KUMPIRMAHA, gihangyo nimo ang pagtangtang sa imong tanang datos sa Among us. Kini nga hangyo molungtad og 7-14 ka adlaw ug muresulta sa pagkawala sa tanang mga Star, XP, Beans, Pods, ug napalit nga mga Cosmetics. Sa dihang hingpit nang matangtang ang imong account, dili na namo mabalik kini nga aksyon. Mu-function nga normal ang imong account hangtod nga makumpleto ang proseso sa pagtangtang.\n\nKung makasinati ka og bisan unsang mga error, palihug kontaka ang support@innersloth.com.",
        [StringName.DeleteAccount]: "Tangtanga ang Account",
        [StringName.DoNotDeleteAccount]: "Ikansela ang Pagtangtang sa Account",
        [StringName.AccountUnDeleteHelp]: "Pinaagi sa pagpindot sa KUMPIRMAHA, mahunong nimo ang proseso sa pagtangtang sa imong account. Kung gusto nimong tangtangon ang imong account, kinahanglan nimong ihangyo kini pag-usab.\n\nKung makasinati ka og bisan unsang mga error, palihug kontaka ang support@innersloth.com.",
