        [StringName.HowToPlayText1]: "Among Us est un jeu de trahison et de travail d'équipe.\n\nLes joueurs sont des coéquipiers ou des imposteurs.",
        [StringName.HowToPlayText2]: "Disputez des parties de 4 à 15 joueurs en ligne ou en Wi-Fi local !",
        [StringName.HowToPlayText41]: "Quand vous hébergez une partie, c'est vous qui fixez les règles.",
        [StringName.HowToPlayText42]: "D'abord, choisissez avec qui vous voulez jouer !\n\nSi vous préférez jouer avec des amis en ligne, réglez sur « privé » et fournissez-leur le code de ce salon.\n\nSi vous voulez jouer avec des joueurs du monde entier, réglez sur « public ».",
        [StringName.HowToPlayText43]: "Vous voulez plus de tâches ? Marcher plus vite ? Augmenter le nombre d'imposteurs ? En tant qu'hôte, vous pouvez modifier ces réglages. Pensez à avertir les autres joueurs.",
        [StringName.HowToPlayText44]: "Si un joueur est grossier et/ou spamme non-stop, l'hôte peut l'expulser temporairement en guise d'avertissement ou le bannir du salon en ligne.",
        [StringName.HowToPlayTextMap]: "Les joueurs ont accès à une carte pour les aider à parcourir le vaisseau.",
        [StringName.HowToPlayTextCrew1]: "Objectif : remplir la barre des tâches ou découvrir l'imposteur.",
        [StringName.HowToPlayTextCrew2]: "Remplissez la jauge en terminant des tâches.",
        [StringName.HowToPlayTextCrew3]: "Réagissez à un sabotage de l'imposteur.",
        [StringName.HowToPlayTextCrew4]: "Imposteur démasqué ? Demandez une réunion.",
        [StringName.HowToPlayTextCrew5]: "Signalez des corps.",
        [StringName.HowToPlayTextCrew6]: "Cherchez toute activité suspecte sur la carte Admin et Sécurité.",
        [StringName.HowToPlayTextImp1]: "Objectif : tuer les membres d'équipage.",
        [StringName.HowToPlayTextImp2]: "Devenez invisible parmi l'équipage.",
        [StringName.HowToPlayTextImp3]: "Faufilez-vous dans les conduits d'aération.",
        [StringName.HowToPlayTextImp4]: "Faites semblant d'accomplir des tâches.",
        [StringName.HowToPlayTextImp5]: "Sabotez le vaisseau et embrouillez l'équipage.",
        [StringName.HowToPlayTextImp6]: "Verrouillez les portes et enfermez des joueurs.",
        [StringName.HowToPlayTextImp7]: "Tuez les membres d'équipage entre les temps morts.",
        [StringName.HowToPlayText5]: "Lorsque vous jouez en personne, vous n'avez pas le droit de parler, histoire de garantir l'équité du jeu entre l'équipage et l'imposteur.\n\nSi l'imposteur tue un joueur, il est interdit à celui-ci de parler jusqu'à la fin de la partie.\n\nLes fantômes poursuivent toujours leurs tâches pour essayer de faire gagner leurs coéquipiers.",
        [StringName.HowToPlayText6]: "Lorsqu'un joueur signale un corps ou demande une réunion d'urgence, les membres d'équipage se réunissent pour partager les infos qu'ils ont glanées sur l'imposteur.\n\nVous pourrez alors parler librement et présenter vos théories sur l'identité de l'imposteur. Si vous jouez en personne, les fantômes n'ont pas le droit de parler (vu qu'ils savent qui est l'imposteur).\n\nLes imposteurs essaieront de prouver leur innocence ou d'accuser un autre membre de l'équipage.",
        [StringName.HowToPlayText7]: "Après discussion, votez pour le joueur qui, selon vous, est l'imposteur.\n\nLe joueur qui recueillera le plus de votes sera éjecté du vaisseau, alors votez judicieusement !\n\nVous pouvez aussi décider d'un commun accord de ne pas voter. Vous pourrez alors réunir plus d'informations et éviter ainsi d'éjecter un innocent.",
        [StringName.HowToPlayText81]: "Faites-vous la main avec le mode Entraînement !",
        [StringName.HowToPlayText82]: "Configurez vos tâches comme membre d'équipage ou peaufinez vos stratégies meurtrières d'imposteur !",
