        [StringName.LocalHelp]: "Des soucis de connexion ?\n\n● Vérifiez que tout le monde est connecté au même réseau Wi-Fi\n● Vérifiez que tout le monde possède la même version (voir en bas à droite)\n● Vérifiez que le signal Wi-Fi est suffisamment fort\n● Essayez de confier l'hébergement de la partie à un autre joueur\n● Essayez de redémarrer l'application\n● Essayez de redémarrer votre téléphone\n● Le problème persiste ? Contactez support@innersloth.com !",
        [StringName.OnlineHelp]: "Comment ça marche ?\n\n● Héberger une partie génère un code qui s'affiche dans le panneau latéral du salon.\n● Fournissez ce code à vos amis pour créer un salon privé.\n● Ou sélectionnez Privé afin de rendre le salon public pour l'option « Trouver partie ».\n● L'hôte peut bannir ou expulser des joueurs chaque fois que le chat est disponible.\n● Le problème persiste ? Contactez support@innersloth.com !",
