        [StringName.AdPolicyTitle]: "Politique publicitaire",
        [StringName.AdPolicyText]: "Pouvons-nous utiliser vos données personnelles pour vous proposer des publicités personnalisées ? Si vous cliquez sur « oui », nos partenaires publicitaires, tels que Google AdMob et Unity Ads, collecteront automatiquement des données et utiliseront des identifiants d'appareils, ainsi que des cookies pour la personnalisation des publicités. Si vous cliquez sur « non », il est possible que vous receviez toujours des publicités non personnalisées. Pour supprimer toutes les publicités, achetez la mise à niveau sans pub [httpstore]ici[]. Vous et vos amis ne recevrez alors plus aucune publicité lorsque vous hébergerez des parties ! Pour en savoir plus sur nos pratiques de confidentialité et celles de nos partenaires publicitaires, veuillez consulter notre [https://www.innersloth.com/fr/privacy-policy-french/]Charte de confidentialité[]. Vous pouvez modifier votre décision à tout moment dans le menu des paramètres, sous « Données ».",
