        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Rôle coéquipier : {0}",
            "ImpostorRole": "Rôle imposteur : {0}",
            "Scientist_01": "Le scientifique peut accéder à un tableau portable des signes vitaux pour contrôler le statut de l'équipage.",
            "Scientist_02": "Cependant, cet appareil doit être chargé, pour ce faire le scientifique devra terminer des tâches.",
            "Engineer_01": "L'ingénieur est un coéquipier qui peut utiliser les conduits d'aération pour se déplacer plus rapidement, et pour prendre sur le fait les imposteurs.",
            "Engineer_02": "Attention, vous ne pouvez pas passer votre vie là-dedans, et ce comportement est suspect, il serait dommage que cela cause votre perte...",
            "GuardianAngel_01": "L'ange gardien est le fantôme d'un coéquipier. Il peut octroyer un bouclier ou une protection temporaire à ses coéquipiers toujours en vie.",
            "GuardianAngel_02": "En vous servant de cette capacité au bon moment, vous pourrez empêcher des imposteurs de tuer leur victime. Quelle chance !",
            "Shapeshifter_01": "Le métamorphe peut changer d'apparence en prenant celle des coéquipiers. En le faisant correctement, vous pourrez orienter les suspicions vers un autre coéquipier et instaurer le doute sur l'identité du véritable imposteur.",
            "Shapeshifter_02": "Mais attention, le déguisement ne dure pas et laisse des traces derrière lui.",
            "Noisemaker_01": "Le tapageur n'est pas un coéquipier comme les autres. Contrairement aux autres rôles, il n'a pas de capacité spéciale à utiliser. À la place, il lance automatiquement une alerte lorsqu'il est tué.",
            "Noisemaker_02": "L'alerte peut facilement faire perdre ses moyens à l'imposteur. Voyez vos coéquipiers foncer vers la scène du crime pour surprendre le tueur et venger votre mort !",
            "Tracker_01": "Le mouchard peut voir l'emplacement d'un coéquipier sur sa carte. Il doit d'abord se trouver près de celui-ci pour pouvoir poser son mouchard. Faites attention à ne pas avoir l'air trop suspect en l'approchant.",
            "Tracker_02": "Le mouchard ne dure que quelques secondes, alors choisissez bien votre cible. Ne passez pas non plus trop de temps à regarder votre carte, au risque de vous faire surprendre par un imposteur !",
            "Phantom_01": "Le spectre peut devenir invisible pour s'approcher furtivement d'un coéquipier ou s'éloigner d'une scène de crime sans se faire prendre. Il ne peut pas tuer tant qu'il est invisible, mais il peut utiliser les échelles et les tyroliennes.",
            "Phantom_02": "Activer et désactiver l'invisibilité émet un grand nuage de fumée, donc assurez-vous qu'il n'y a pas de coéquipier dans les parages ! Vous ne resterez pas invisible indéfiniment, alors calculez bien votre coup.",
            "Detective_01": "Le détective est un coéquipier qui excelle dans la résolution de meurtres ! Grâce à ses notes, il dispose d'informations importantes à propos de chaque élimination.",
            "Detective_02": "Le détective peut interroger les autres coéquipiers afin d'en savoir plus sur leur emplacement au moment du meurtre. Utilisez vos informations et trouvez le coupable !",
            "Viper_01": "La vipère utilise un acide mortel pour tuer les coéquipiers. Les corps des victimes se dissolvent lentement en trois étapes avant de disparaître complètement.",
            "Viper_02": "Une vipère intelligente s'assure que toutes ses éliminations ne soient jamais découvertes. Utilisez le sabotage à votre avantage !"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Les rôles ajoutent une nouvelle dimension de subterfuges et de stratégie au jeu classique !",
            "02": "Les coéquipiers et les imposteurs peuvent avoir des rôles assignés aléatoirement, en fonction des réglages de partie choisis par l'hôte."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Les rôles peuvent être personnalisés ! Les hôtes peuvent choisir le nombre de passages possibles dans les conduits pour l'ingénieur, le temps mort du métamorphe, etc. Ils peuvent aussi contrôler le pourcentage de chances pour que ces rôles surviennent en jeu. Il est toujours possible de voir si un rôle est activé dans les réglages du salon du jeu !",
            "02": "Modifiez les réglages afin de créer le salon de vos rêves, ou rejoignez un salon existant pour y semer le chaos. Nous ajouterons peut-être de nouveaux rôles, alors revenez régulièrement jeter un coup d'œil par ici. Amusez-vous bien !"
        },
