        [StringName.SettingsColorblind]: "Mode daltonien",
        [StringName.MergeGuestAccountText]: "Il y a un <link=\"https://www.innersloth.com/merging-guest-accounts/\">compte invité</link> sur cet appareil ! Nous ne prenons plus en charge les comptes invité et fusionnerons donc les objets, les monnaies et la progression du compte invité avec ce compte {0}.\n\nSi vous partagez cet appareil (ordinateur, téléphone, etc.) avec d'autres personnes, chacune d'entre elles PARTAGE ce compte invité. Si vous continuez, aucun autre utilisateur de l'appareil ne pourra fusionner ce compte invité. Ce dernier ne peut être fusionné qu'UNE seule fois. Vous ne pourrez PAS réassigner les objets, les monnaies et la progression de ce compte invité.\n\nConfirmez l'association de votre compte invité à ce compte {0}.",
