        [StringName.AccountDeleteHelp]: "En appuyant sur CONFIRMER, vous demandez à supprimer toutes vos données Among Us. Cette demande sera traitée dans les 7 à 14 jours et entraînera la suppression de vos étoiles, votre EXP, vos haricots, vos pods et vos cosmétiques. La suppression de compte est irréversible, et votre compte fonctionnera normalement jusqu'à la fin du processus.\n\nEn cas de problème, contactez support@innersloth.com.",
