        [StringName.TagFiltersHelpFindGame]: "Vous pouvez filtrer la recherche de parties en sélectionnant des tags dans la liste déroulante Filtres. Les résultats de la recherche correspondront <i>exactement</i> aux filtres que vous sélectionnez.\n\nExemple : Si vous sélectionnez <b>Moyen</b> et <b>Expert</b>, vous ne trouverez que les parties marquées avec les deux filtres <b>Moyen</b> et <b>Expert</b>.",
        [StringName.TagFiltersHelpCreate]: "Vous pouvez attribuer des filtres à votre partie pour aider les joueurs à la trouver. Les résultats de la recherche correspondront <i>exactement</i> aux filtres sélectionné.\n\nExemple : Si vous sélectionnez <b>Moyen</b> et <b>Expert</b>, seules les personnes qui recherchent les deux filtres <b>Moyen</b> et <b>Expert</b> pourront voir votre jeu.",
        [StringName.CreateLabel]: "Créer",
        [StringName.NewGameMode]: "Nouveau mode de jeu !",
        [StringName.NewModeInfo]: "La tension est à son comble dans ce mode de jeu à couper le souffle ! \n<i>Mais attention, ce n'est pas un cache-cache ordinaire...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "Rien de plus simple !",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Coéquipiers !",
        [StringName.HideSeekHowToPlayCaptionThree]: "Imposteurs !",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Coéquipiers :</b></color> Effectuez des tâches pour accélérer le chrono, évitez l'imposteur et restez en vie jusqu'à la fin du temps imparti.\n<color=#FF3131><b>Imposteur :</b></color> Trouvez les coéquipiers et décimez-les jusqu'au dernier.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Pas de pitié, que des cris de terreurs.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Maîtrisez l'art du cache-cache pour rester en vie.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "Dans ce mode, vous pouvez utiliser les conduits d'aération et vous disposez d'un indicateur de danger high-tech qui vous alerte quand l'imposteur se rapproche. L'imposteur a un champ de vision limité, alors utilisez votre intelligence, les conduits d'aération et vos visières pour le fuir !",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Dans ce mode, l'imposteur ne peut pas emprunter les conduits d'aération. Il faut donc être rapide pour attraper vos proies. Dis donc, il fait noir ici ! Heureusement que vous avez une lampe torche pour trouver vos prochaines victimes.",
        [StringName.HideSeekHowToPlayFinalHide]: "Tic-tac, tic-tac... le temps est compté. Juste avant la fin du temps imparti, l'imposteur bénéficie d'un bonus : il est plus rapide, dispose d'une carte spéciale et d'un ping directionnel pour localiser les coéquipiers survivants. Pour gagner, vous allez devoir réfléchir vite et fuir de manière stratégique !",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Utilisez le joystick virtuel de la lampe torche qui se trouve à droite de votre écran pour orienter votre faisceau et tuer tous les coéquipiers que vous trouvez !",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Utilisez votre souris pour orienter le faisceau de votre lampe torche et tuer tous les coéquipiers que vous trouvez !",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Utilisez le stick analogique droit pour orienter le faisceau de votre lampe torche et tuer tous les coéquipiers que vous trouvez !",
