        [StringName.HowToPlayTextImp6]: "Opfer hinter Türen einsperren.",
        [StringName.HowToPlayTextImp7]: "Besatzung zwischen Wartezeiten umbringen.",
        [StringName.HowToPlayText5]: "Beim gemeinsamen Spielen in einem Raum herrscht Schweigepflicht, damit das Spiel für Besatzung und Verräter fair bleibt.\n\nWird ein Spieler vom Verräter getötet, darf der bis zum Spielende nicht reden.\n\nGeister können immer noch die zugewiesenen Aufgaben erledigen, um einen möglichen Sieg der Besatzung zu unterstützen.",
        [StringName.HowToPlayText6]: "Meldet jemand eine Leiche oder beruft ein Notfall-Treffen ein, versammelt sich die Besatzung, um alles zu besprechen, was über den Verräter bekannt ist.\n\nDie Spieler können dann offen sagen, wen sie für den Verräter halten und welche Infos sie haben. Spielt ihr gemeinsam in einem Raum, dürfen Geister nicht reden, weil sie bereits wissen, wer der Verräter ist.\n\nVerräter müssen ihre Unschuld beweisen oder andere Besatzungsmitglieder beschuldigen.",
        [StringName.HowToPlayText7]: "Nach der Besprechung stimmt ihr ab, wen ihr für den Verräter haltet.\n\nDer Spieler mit den meisten Stimmen wird aus dem Schiff geworfen. Also nie leichtfertig abstimmen!\n\nLiegen nicht genug Infos vor, könnt ihr als Besatzung beschließen, die Abstimmung zu überspringen, damit kein Unschuldiger rausgeworfen wird und ihr noch mehr Infos sammeln könnt.",
        [StringName.HowToPlayText81]: "Übe im Übungsmodus!",
        [StringName.HowToPlayText82]: "Lege Aufgaben als Besatzungsmitglied selbst fest oder trainiere Mordstrategien als Verräter!",
