        [StringName.LocalHelp]: "Verbindungsprobleme?\n\n● Alle müssen mit demselben WLAN-Namen verbunden sein\n● Alle müssen dieselbe Version nutzen (unten rechts)\n● Das WLAN-Signal muss stark genug sein\n● Manchmal hilft es, wenn ein anderer Spieler hostet\n● Manchmal hilft es, die App neu zu starten ...\n● Manchmal hilft es, das Smartphone neu zu starten ...\n● Trotzdem noch Probleme? Teile es uns mit einer E-Mail an support@innersloth.com mit!",
        [StringName.OnlineHelp]: "Wie funktioniert das?\n\n● Als Host einer Partie bekommst du einen Spielcode in der Lobby.\n● Teile den Spiel-Code mit Freunden, um einen privaten Raum zu erstellen.\n● Oder tippe \"Privat\" an, um den Raum für die \"Spielsuche\" öffentlich zu machen.\n● Der Host kann Spieler sperren oder rauswerfen, wenn ein Chat verfügbar ist.\n● Weitere Probleme? Teile es uns mit einer E-Mail an support@innersloth.com mit!",
