        [StringName.UnlinkAccountExplainConfirm]: "Bitte speichere diese ID:\n\n{0}\n\nWenn du die Verknüpfung mit deinem Konto aufhebst und diese ID nicht hast, können wir deinen Fortschritt nicht wiederherstellen und dir nicht weiterhelfen, falls ein Irrtum vorliegt.",
