        [StringName.ConfirmLinkExistingAccount]: "Verknüpfung mit vorhandenem Konto bestätigen",
        [StringName.LinkExistingAccountExplain]: "Bei der Verknüpfung mit einem anderen Konto werden alle Daten auf dieser Plattform überschrieben. Das bedeutet, dein {0}-Among-Us-Konto wird durch das andere Konto ersetzt.\n– Alle Gegenstände, die du auf deinem {0}-Konto freigeschaltet hast, werden überschrieben.\n– Alle EP, die du auf deinem {0}-Konto hattest, werden überschrieben.\n– Alle Bohnen, Kapseln und Sterne werden überschrieben.",
        [StringName.LinkExistingAccountExplainConfirm]: "Sobald du die Verknüpfung bestätigst, setzen wir dein {0}-Among-Us-Konto zurück, um den Datenimport von einem anderen Konto vorzubereiten.\n\n<color=#{1}>ACHTUNG: DU BRAUCHST EIN ZWEITES BESTEHENDES KONTO, DAS DU MIT DIESEM VERKNÜPFEN KANNST, BEVOR DU WEITERMACHST.</color>\n\nBeim Zurücksetzen deines {0}-Kontos werden alle EP, Bohnen, Kapseln und Gegenstände auf 0 gesetzt. Das können wir NICHT rückgängig machen.",
