        [StringName.StarDisclaimer]: "Kaufe Among-Us-Sterne und schalte eine neue Galaxie von Anpassungen frei! Im In-game-Store kannst du dafür exklusive Kosmetik und einmalige Cosmicubes kaufen. Alle hier gekauften Sterne können weder auf PlayStation® noch auf Nintendo Switch™ eingelöst oder verwendet werden.",
