        [StringName.ItchNoStars]: "Sterne können leider nicht auf itch.io gekauft werden, aber wenn du dein Konto bei itch.io mit einer anderen Plattform verknüpfst (z. B. anderen PC-Versionen), kannst du von dort aus Sterne kaufen und auf sie zugreifen! Hinweis: Auf Nintendo Switch™ gekaufte Sterne sind nicht plattformübergreifend und können auf keiner anderen Plattform eingelöst werden.",
