        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Besatzungsrolle: {0}",
            "ImpostorRole": "Verräterrolle: {0}",
            "Scientist_01": "Der Wissenschaftler kann überall auf eine tragbare Lebensanzeige zugreifen, um den Status der Besatzung zu überprüfen.",
            "Scientist_02": "Aber der Bildschirm muss aufgeladen werden. Um die Batterie wieder aufzuladen, muss der Wissenschaftler also Aufgaben erledigen.",
            "Engineer_01": "Der Ingenieur ist ein Besatzungsmitglied, das sich mit Hilfe von Schächten schneller fortbewegen und Verräter in Schächten auf frischer Tat ertappen kann.",
            "Engineer_02": "Natürlich kann man sich nicht für immer darin verstecken, und es ist schon sehr verdächtig, also pass lieber auf, wo du gehst und stehst ...",
            "GuardianAngel_01": "Der Schutzengel ist der Geist eines Besatzungsmitglieds. Sie können andere lebende Besatzungsmitglieder vorübergehend abschirmen und schützen.",
            "GuardianAngel_02": "Wenn du es richtig anstellst, kannst du verhindern, dass Verräter ihr Opfer töten. Was ein Glück!",
            "Shapeshifter_01": "Der Formwandler kann sein Aussehen ändern und sich als andere Besatzungsmitglieder ausgeben. Wenn du es richtig anstellst, schiebst du anderen Besatzungsmitgliedern die Schuld in die Schuhe und stiftest Verwirrung darüber, wer der wahre Verräter ist!",
            "Shapeshifter_02": "Aber Vorsicht – die Tarnung hält nicht ewig und hinterlässt Spuren.",
            "Noisemaker_01": "Die Heulboje ist kein gewöhnliches Besatzungsmitglied. Sie hat keine Fähigkeit so wie alle anderen Rollen. Stattdessen schlägt sie Alarm, wenn sie von einem Verräter getötet wird.",
            "Noisemaker_02": "Der Alarm versetzt den Verräter schnell in Panik. Sieh zu, wie deine Kameraden zum Tatort eilen, um den Mörder zu fangen und deinen Tod zu rächen!",
            "Tracker_01": "Die Spürnase kann die Position eines Besatzungsmitglieds auf der Minimap sehen. Sie muss sich zunächst neben einem anderen Besatzungsmitglied befinden, um den Peilsender zu platzieren. Achte darauf, nicht aufzufallen, wenn du dich dem anderen Besatzungsmitglied näherst.",
            "Tracker_02": "Die Ortung dauert nur ein paar Sekunden, also wähle dein Ziel sorgfältig. Aber guck lieber nicht zu lange auf deine Minimap, denn sonst fällst du schnell einem Verräter zum Opfer!",
            "Phantom_01": "Das Phantom kann unsichtbar werden, um sich klammheimlich an ein Besatzungsmitglied heranzuschleichen oder den Tatort zu verlassen, ohne erwischt zu werden. Das Phantom kann in seiner unsichtbaren Form nicht töten, aber es kann immer noch Leitern und Seilrutschen benutzen.",
            "Phantom_02": "Unsichtbar oder wieder sichtbar werden verursacht eine große Rauchwolke, also stelle sicher, dass sich keine Besatzungsmitglieder in deiner Nähe aufhalten! Die Unsichtbarkeit hält auch nicht ewig an, also achte darauf, deine Fähigkeit zum richtigen Zeitpunkt einzusetzen.",
            "Detective_01": "Kein Besatzungsmitglied klärt Morde so organisiert auf wie der Detektiv! Mithilfe seiner Notizen kann er alle wichtigen Informationen über jeden Todesfall festhalten.",
            "Detective_02": "Anschließend kann der Detektiv die restliche Besatzung verhören, um herauszufinden, wo sie sich zum Tatzeitpunkt befunden haben. Zähle eins und eins zusammen und finde den Mörder!",
            "Viper_01": "Die Viper bringt Besatzungsmitglieder mit ihrer tödlichen Säure um. Die Leichen lösen sich langsam in drei Schritten auf, bis sie komplett verschwunden sind.",
            "Viper_02": "Eine gewiefte Viper achtet darauf, dass ihre Opfer nie gefunden werden. Lenk die Besatzung mit Sabotagen ab!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Rollen fügen dem klassischen Spiel eine ganz neue Ebene voller Täuschung und Strategie hinzu!",
            "02": "Sowohl die Besatzung als auch die Verräter können je nach den vom Host gewählten Spieleinstellungen zufällige Rollen erhalten."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Die Rollen sind anpassbar! Die Hosts können z. B. die Wartezeit des Formwandlers bestimmen oder wie oft ein Ingenieur Schächte nutzen kann. Sie können auch die prozentuale Chance für das Vorkommen dieser Rollen im Spiel festlegen. Du kannst jederzeit in den Einstellungen der Spiel-Lobby sehen, ob eine Rolle aktiviert ist!",
            "02": "Spiel mit den Einstellungen herum, die dir am besten gefallen, um deine ultimative Lobby zu erstellen, oder tritt einer bei und sieh, welches Chaos du dort anrichten kannst. Es könnte sein, dass wir dem Spiel in Zukunft neue Rollen hinzufügen, also schau bei Bedarf immer wieder hier vorbei. Viel Spaß!"
        },
