        [StringName.Decontamination3]: "Untere Dekontamination",
        [StringName.ErrorCommunications]: "Deine Kommunikationseinstellungen verhindern den Beitritt zum Spiel. Bitte aktiviere Kommunikation mit anderen, um beizutreten.",
        [StringName.SettingsColorblind]: "Text für Farbenblinde",
        [StringName.MergeGuestAccountText]: "Auf diesem Gerät scheint es ein <link=\"https://www.innersloth.com/merging-guest-accounts/\">Gastkonto</link> zu geben! Wir unterstützen keine Gastkonten mehr und werden alle Objekte, Währungen und Erfahrung aus deinem Gastkonto in dieses {0}-Konto übernehmen.\n\nWenn du dieses Gerät (Computer, Handy usw.) mit anderen Personen teilst, beachte bitte, dass jeder, der dieses Gerät benutzt, dieses Gastkonto TEILT. Keine anderen Benutzer auf diesem Gerät können dieses Gastkonto zusammenführen, wenn du fortfährst, und du kannst dieses Gastkonto nur EINMAL zusammenführen. Du kannst die Objekte, Währungen und Erfahrung, die mit diesem Gastkonto verbunden sind, NICHT noch einmal zuweisen.\n\nBitte bestätige, dass du dein Gastkonto mit diesem {0}-Konto zusammenführen möchtest.",
