        [StringName.UserIdTokenError]: "Benutzerauthentifizierung abgelaufen. Bitte starte das Spiel neu, wenn das Problem weiterhin besteht.",
        [StringName.AccountDeleteHelp]: "Wenn du BESTÄTIGEN wählst, beantragst du die Löschung aller deiner Daten von Among Us. Diese Anfrage dauert 7 bis 14 Tage und führt zur Löschung aller Sterne, EP, Bohnen, Kapseln und gekauften Kosmetik. Sobald dein Konto vollständig gelöscht ist, können wir diesen Vorgang nicht mehr rückgängig machen. Dein Konto funktioniert normal weiter, bis der Löschvorgang abgeschlossen wurde.\n\nBitte wende dich bei Fehlern an support@innersloth.com.",
        [StringName.DeleteAccount]: "Konto löschen",
        [StringName.DoNotDeleteAccount]: "Kontolöschung abbrechen",
        [StringName.AccountUnDeleteHelp]: "Wenn du BESTÄTIGEN wählst, wird die Kontolöschung abgebrochen. Falls du dein Konto später löschen möchtest, musst du dies erneut beantragen.\n\nBitte wende dich bei Fehlern an support@innersloth.com.",
