        [StringName.TagFiltersHelpFindGame]: "Du kannst die Spielsuche filtern, indem du Tags aus der Filter-Dropdownliste auswählst. Die ausgewählten Filter stimmen mit den Suchergebnissen <i>exakt</i> überein.\n\nBeispiel: Wenn du <b>Casual</b> und <b>Experte</b> auswählst, findest du nur Spiele mit den Tags <b>Casual</b> und <b>Experte</b>.",
        [StringName.TagFiltersHelpCreate]: "Du kannst dein Spiel mit Filter-Tags kennzeichnen, damit andere Spieler es leichter finden. Die ausgewählten Filter stimmen mit den Suchergebnissen <i>exakt</i> überein.\n\nBeispiel: Wenn du <b>Casual</b> und <b>Experte</b> auswählst, finden dein Spiel nur Spieler, die nach <b>Casual</b> und <b>Experte</b> suchen.",
        [StringName.CreateLabel]: "Erstellen",
        [StringName.NewGameMode]: "Neuer Spielmodus!",
        [StringName.NewModeInfo]: "Ein atemberaubender Spielmodus erwartet dich! \n<i>Aber Moment ... das hier ist kein normales Versteckspiel ...<i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "Ganz einfach!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Besatzung!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Verräter!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Besatzung:</b></color> Erledige Aufgaben, um die Zeit zu verkürzen, verstecke dich vor dem Verräter und bleib am Leben, bis die Zeit um ist.\n\n<color=#FF3131><b>Der Verräter:</b></color> Finde die Besatzung und starte deine Mordserie.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Keine gemeinsamen Aktionen, nur entsetztes Schreien.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Werde zum Meister des Versteckspiels, um zu überleben.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "In diesem Modus kannst du die Schächte nutzen und mit einem Hightech-Gefahrenmelder arbeiten, der dich warnt, wenn sich ein Verräter nähert. Der Verräter hat eingeschränkte Sicht, also sei schlau und nutze die Schächte und deine Visiere, um ihm aus dem Weg zu gehen!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Verräter können in diesem Modus keine Schächte nutzen, also sei schnell, wenn du deine Beute fangen willst. Es ist dunkel da draußen! Zum Glück hast du eine Taschenlampe, mit der du dein nächstes Opfer finden kannst.",
        [StringName.HideSeekHowToPlayFinalHide]: "Showdown! Kurz vor Ende des Spiels bekommt der Verräter einen Energie-Boost - er wird schneller, erhält eine spezielle Karte zum Suchen und Hinweise auf die Positionen überlebender Besatzungsmitglieder.\n\nSei schnell und entscheide strategisch, um zu gewinnen!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Verwende den virtuellen Taschenlampen-Joystick auf der rechten Seite deines Bildschirms, um deinen Lichtstrahl zu steuern und alle Besatzungsmitglieder zu töten, die du finden kannst!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Verwende deine Maus, um den Lichtstrahl deiner Taschenlampe zu steuern und alle Besatzungsmitglieder zu töten, die du finden kannst!",
