        [StringName.AskForEosAccount]: "Hast du bereits ein Among-Us-Konto? (Auch Epic Online Services-Konto genannt.)\n\nFalls du Among Us schon einmal auf diesem Gerät gespielt hast, wähle 'Ja'.",
        [StringName.KwsCreateFail]: "Oje! Beim Versenden der Mail mit der Erlaubnis des Erziehungsberechtigten ist etwas schiefgelaufen. Bitte versuche es noch einmal oder fahre im Offline-Modus fort.\n\nNochmal versuchen?",
