        [StringName.ErrorClientTimeout]: "Du hast die Verbindung zum Server verloren. Dies kann aufgrund von Problemen mit dem Server, Netzwerk oder Gerät passieren. Überprüfe die Signalstärke deines Netzwerks.\n\nWenn dies häufig vorkommt, ist dein Gerät möglicherweise zu alt oder erfüllt nicht die Mindestanforderungen. Versuche, mit einem anderen Gerät zu spielen.",
