        [StringName.NoisemakerBlurbLong]: "Die Heulboje ist kein gewöhnliches Besatzungsmitglied. Sie hat keine Fähigkeit so wie alle anderen Rollen. Stattdessen schlägt sie Alarm, wenn sie von einem Verräter getötet wird. Der Alarm versetzt den Verräter schnell in Panik. Sieh zu, wie deine Kameraden zum Tatort eilen, um den Mörder zu fangen und deinen Tod zu rächen!",
