        [StringName.PhantomBlurb]: "Unsichtbar werden",
        [StringName.PhantomBlurbMed]: "Werde unsichtbar, um dich anzuschleichen\noder einem Mord zu entgehen.",
        [StringName.PhantomBlurbLong]: "Das Phantom kann unsichtbar werden, um sich klammheimlich an ein Besatzungsmitglied heranzuschleichen oder den Tatort zu verlassen, ohne erwischt zu werden. Das Phantom kann in seiner unsichtbaren Form nicht töten, aber es kann immer noch Leitern und Seilrutschen benutzen. Unsichtbar oder wieder sichtbar zu werden verursacht eine große Rauchwolke, also stelle sicher, dass sich keine Besatzungsmitglieder in deiner Nähe aufhalten! Die Unsichtbarkeit hält auch nicht ewig an, also achte darauf, deine Fähigkeit zum richtigen Zeitpunkt einzusetzen.",
