        [StringName.AdPolicyTitle]: "Politica sugli annunci pubblicitari",
        [StringName.AdPolicyText]: "Possiamo utilizzare i tuoi dati personali per personalizzare gli annunci pubblicitari per te? Se selezioni sì, i nostri partner pubblicitari come Google AdMob e Unity Ads raccoglieranno dati e utilizzeranno cookie e identificatori di dispositivo per la personalizzazione degli annunci. Se selezioni no, potresti comunque vedere annunci non personalizzati. Per nascondere tutti gli annunci, acquista [httpstore]qui[] l'aggiornamento per rimuoverli. In questo modo, quando ospiterai le partite, tu e i tuoi amici non vedrete nessun annuncio! Per saperne di più sulle nostre pratiche relative alla privacy e su quelle dei nostri partner pubblicitari, consulta la nostra [https://www.innersloth.com/it/privacy-policy-italian/]informativa sulla privacy[]. Puoi modificare la tua scelta in qualsiasi momento nelle impostazioni alla voce Dati.",
