        [StringName.StarDisclaimer]: "Acquista Stelle di Among Us per sbloccare una nuova galassia di personalizzazioni! Utilizza le Stelle nel negozio di gioco per ottenere oggetti estetici esclusivi e Cosmicubi unici. Tutte le stelle acquistate qui non sono riscattabili o utilizzabili su PlayStation® o Nintendo Switch™.",
