        [StringName.AndroidAssetBundleWarning]: "Per completare l'installazione di Among Us, è necessario scaricare contenuti aggiuntivi. Premi \"Accetta\" per continuare.",
        [StringName.ItchNoStars]: "Sfortunatamente, non è possibile acquistare Stelle su itch.io. Tuttavia, collegando il tuo account itch.io a un'altra piattaforma (per esempio, altre versioni per PC) potrai acquistare e accedere alle Stelle da lì! Nota: le Stelle acquistate su Nintendo Switch™ non sono crossplatform e non possono essere riscattate su nessun'altra piattaforma.",
