        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Ruolo astronauta: {0}",
            "ImpostorRole": "Ruolo impostore: {0}",
            "Scientist_01": "Lo Scienziato può accedere in qualsiasi momento a un pannello portatile che mostra i segni vitali dei membri dell'equipaggio.",
            "Scientist_02": "Tuttavia, il pannello deve essere caricato, quindi lo Scienziato deve completare gli incarichi per riempire la batteria.",
            "Engineer_01": "L'Ingegnere è un astronauta che può usare i condotti per spostarsi più velocemente e cogliere sul fatto gli impostori che li stanno utilizzando.",
            "Engineer_02": "Tuttavia, non puoi stare lì dentro per sempre; gli altri potrebbero insospettirsi! Fai attenzione a chi è nei paraggi quando usi i condotti...",
            "GuardianAngel_01": "L'Angelo custode è il fantasma di un astronauta. Può concedere uno scudo protettivo temporaneo agli altri astronauti ancora in vita.",
            "GuardianAngel_02": "Utilizzandolo al momento giusto, potrai impedire agli impostori di uccidere la loro vittima. Che fortuna!",
            "Shapeshifter_01": "Il Mutaforma può modificare il proprio aspetto e assumere quello di un altro astronauta. Fanne buon uso per incastrare gli altri astronauti e seminare dubbi su chi sia il vero impostore!",
            "Shapeshifter_02": "Ma fai attenzione: il travestimento è solo temporaneo, e lascia dietro sé delle prove.",
            "Noisemaker_01": "Lo Starnazzatore non è un astronauta qualunque: a differenza degli altri, non ha un'abilità attiva. In compenso, però, diffonde automaticamente un allarme quando viene ucciso dall'impostore.",
            "Noisemaker_02": "Molto probabilmente l'allarme manderà l'impostore nel panico. Osserva gli astronauti che accorrono sul luogo del misfatto per acciuffare l'assassino e vendicare la tua morte!",
            "Tracker_01": "Il Segugio può seguire la posizione di un astronauta sulla mini-mappa. Innanzitutto deve trovarsi alle spalle di un altro astronauta per posizionare il dispositivo di tracciamento, cercando di non risultare sospetto.",
            "Tracker_02": "Il tracciamento dura pochi secondi, pertanto è bene scegliere con cura il proprio bersaglio. Inoltre, scrutare a lungo la mini-mappa è un'attività rischiosa perché l'impostore potrebbe approfittarne per colpire!",
            "Phantom_01": "Lo Spettro può diventare invisibile per avvicinarsi furtivamente a un astronauta o dileguarsi dalla scena del crimine senza farsi beccare. Non può uccidere mentre è invisibile, ma può sfruttare scale e teleferiche.",
            "Phantom_02": "Svanire e ricomparire produce una vistosa nuvola di fumo, quindi è bene assicurarsi che non ci siano astronauti nei paraggi! L'invisibilità non dura per sempre, pertanto un buon tempismo è fortemente consigliato.",
            "Detective_01": "Il Detective è un astronauta estremamente abile nel risolvere omicidi! Può annotare nei suoi appunti gli elementi importanti relativi a ogni uccisione.",
            "Detective_02": "Il Detective può interrogare gli altri astronauti per scoprire dove si trovavano al momento del delitto. In seguito basterà fare 2+2 per trovare il killer!",
            "Viper_01": "Il Cobra sfrutta un acido letale per uccidere gli astronauti. I corpi si sciolgono lentamente nel corso di tre fasi prima di scomparire del tutto.",
            "Viper_02": "Un Cobra astuto si assicura che le sue vittime non vengano mai trovate. Sfrutta i sabotaggi a tuo vantaggio!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Grazie ai ruoli, aggiungi ancora più inganni e strategia al gioco classico!",
            "02": "Astronauti e impostori possono ricevere dei ruoli a caso in base alle impostazioni scelte dall'host."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "I ruoli sono personalizzabili! Gli host delle partite possono scegliere quante volte un Ingegnere può usare i condotti, i tempi di ricarica dell'abilità del Mutaforma, ecc. Possono anche decidere in quale percentuale questi ruoli appariranno nella partita. Puoi sempre verificare dalle impostazioni della lobby se un ruolo è attivo!",
            "02": "Modifica a tuo piacimento queste impostazioni per creare la tua lobby ideale, oppure entra in una e prova a seminare il caos. In futuro potremmo aggiungere nuovi ruoli, quindi torna a dare un'occhiata se ne avrai bisogno. Buon divertimento!"
        },
