        [StringName.MergeGuestAccountText]: "Sembra che su questo dispositivo sia presente un <link=\"https://www.innersloth.com/merging-guest-accounts/\">account ospite</link> ! Gli account ospite non sono più supportati, pertanto uniremo tutti gli oggetti, le valute e l'esperienza del tuo account ospite a quelle di questo account {0}.\n\nSe questo dispositivo (computer, telefono, ecc.) è usato anche da altre persone, ricorda che questo account ospite è CONDIVISO tra tutti coloro che utilizzano questo dispositivo. Se procederai, gli altri utenti di questo dispositivo non potranno unire i dati di questo account ospite, e potrai effettuare questa operazione UNA SOLA VOLTA. NON potrai ridistribuire nuovamente gli oggetti, le valute e l'esperienza collegate a questo account ospite.\n\nConferma di voler unire il tuo account ospite a questo account {0}.",
