        [StringName.AccountDeleteHelp]: "Premendo CONFERMA, richiederai l'eliminazione di tutti i tuoi dati di Among Us. Saranno necessari 7-14 giorni per evadere questa richiesta e comporterà l'eliminazione di tutte le Stelle, PE, Fagioli, Pod ed Elementi estetici acquistati. L'eliminazione dell'account è irreversibile. Il tuo account funzionerà normalmente fino a quando il processo di eliminazione non sarà completato.\n\nSe riscontri degli errori, contatta support@innersloth.com.",
