        [StringName.TagFiltersHelpFindGame]: "Puoi filtrare la ricerca delle partite selezionando le etichette nel menu a tendina Filtri. I risultati delle ricerche cambaceranno <i>esattamente</i> con i filtri scelti.\n\nEsempio: se selezioni <b>Disimpegnato</b> ed <b> Esperto</b>, troverai solo partite etichettate con entrambi i filtri.",
        [StringName.TagFiltersHelpCreate]: "Puoi usare i filtri per assegnare delle etichette alle tue partite e aiutare i giocatori a trovarle. I risultati delle ricerche combaceranno <i>esattamente</i> con i filtri scelti.\n\nEsempio: se selezioni <b>Disimpegnato</b> ed <b> Esperto</b>, solo i giocatori che hanno selezionato entrambi i filtri troveranno la tua partita.",
        [StringName.CreateLabel]: "Crea",
        [StringName.NewGameMode]: "Nuova modalità di gioco!",
        [StringName.NewModeInfo]: "La posta in gioco è altissima in questa modalità mozzafiato!\n<i>Ma non pensate che sia un normale Nascondino...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "È semplice!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Astronauti!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Impostori!",
        [StringName.HideSeekHowToPlayPageOne]: "Gli <color=#38F25D><b>Astronauti</b></color> devono completare gli incarichi per accelerare il cronometro, evitare l'Impostore e sopravvivere fino allo scadere del tempo.\n\nL'<color=#FF3131><b>Impostore</b></color> deve scovare gli Astronauti e farli fuori tutti.",
        [StringName.HideSeekHowToPlaySubtextOne]: "Non c'è spazio per la deduzione sociale qui, ci sono solo urla di terrore.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Dovrai nasconderti davvero bene per sopravvivere.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "In questa modalità puoi usare i condotti e avere un avanzatissimo Rischiometro che ti avverte quando l'Impostore è nelle vicinanze. L'impostore ha un raggio di visione limitato, quindi sfrutta il tuo acume, i condotti e i visori per sfuggirgli!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "L'Impostore non può usare i condotti in questa modalità, quindi dovrai agire rapidamente per stanare la tua preda. È buio là fuori! Fortunatamente hai una torcia elettrica che ti aiuterà a individuare le tue prossime vittime.",
        [StringName.HideSeekHowToPlayFinalHide]: "A che ora è la fine del mondooo? Negli ultimi istanti della partita, l'Impostore diventa più forte: si muoverà più velocemente, riceverà una mappa Caccia e un segnale direzionale che indicherà la posizione degli Astronauti ancora in vita.\n\nNon fare mosse avventate e mantieni la calma per vincere!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Usa il joystick virtuale della torcia elettrica sulla destra del tuo schermo per dirigere il raggio di luce e uccidi tutti gli Astronauti che trovi!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Usa il tuo mouse per dirigere il raggio di luce della tua torcia elettrica e uccidi tutti gli Astronauti che trovi!",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Usa la levetta destra per dirigere il raggio di luce della tua torcia elettrica e uccidi tutti gli Astronauti che trovi!",
