        [StringName.HowToPlayText1]: "「Among Us」は、チームワークと裏切りがせめぎあうゲームです。\n\nプレイヤーは、クルーかインポスターのどちらかになります。",
        [StringName.HowToPlayText2]: "オンラインまたはローカルのWi-Fiで、4～15人でプレイ可能！",
        [StringName.HowToPlayText41]: "ホストはゲームプレイをコントロールできます。",
        [StringName.HowToPlayText42]: "まず、誰と一緒にプレイするかを決めましょう！\n\n友達とオンラインでプレイする場合は、「非公開」に設定し、ルームコードを共有します。\n\n世界中のプレイヤーとプレイする場合は、「公開」に設定します。",
        [StringName.HowToPlayText43]: "タスク量を増やす、歩行速度を早める、インポスターを増やす...ホストはこれらの設定を変更できます。仲間のプレイヤーに確認してから変更しましょう。",
        [StringName.HowToPlayText44]: "無礼な言動やスパムが見られた場合、ホストは警告としてそのプレイヤーを一時的に追い出す、または特定のオンラインルームからバンすることができます。",
        [StringName.HowToPlayTextMap]: "プレイヤーは、パーソナルマップを使って船内を移動できます。",
        [StringName.HowToPlayTextCrew1]: "目標: タスクゲージを満タンにするか、インポスターを見つけ出す。",
        [StringName.HowToPlayTextCrew2]: "タスクを完了してゲージを溜める。",
        [StringName.HowToPlayTextCrew3]: "インポスターによるサボタージュに対応する。",
        [StringName.HowToPlayTextCrew4]: "インポスターが見つかったら緊急会議を開く。",
        [StringName.HowToPlayTextCrew5]: "死体を通報する。",
        [StringName.HowToPlayTextCrew6]: "怪しい動きがないか、管理室マップと監視カメラで確認する。",
        [StringName.HowToPlayTextImp1]: "目標: クルーを全滅させる。",
        [StringName.HowToPlayTextImp2]: "クルーに紛れ込む。",
        [StringName.HowToPlayTextImp3]: "通気孔に隠れて移動する。",
        [StringName.HowToPlayTextImp4]: "タスクを実行する振りをする。",
        [StringName.HowToPlayTextImp5]: "船でサボタージュを起こし、クルーを混乱させる。",
        [StringName.HowToPlayTextImp6]: "ドアを閉め、被害者を閉じ込める。",
        [StringName.HowToPlayTextImp7]: "クールダウンの合間にクルーを全滅させる。",
        [StringName.HowToPlayText5]: "クルーとインポスターの双方に公平性を保つため、プレイ中の会話は許されない。\n\nインポスターに殺されたプレイヤーは、ゲーム終了まで話してはならない。\n\nゴーストになっても、アサインされたタスクを行い、クルー陣営を勝利に導くよう行動できる。",
        [StringName.HowToPlayText6]: "死体の通報があった、または緊急会議が開かれると、クルーは集合してインポスターについて知っていることを話し合う。\n\nこのとき、自分は誰をインポスターだと考えているか、どんな情報を持っているか、率直に発言できる。ゴーストは誰がインポスターかすでに知っているので、発言できない。\n\nインポスター陣営は無実を主張し、自分以外のクルーを告発する。",
        [StringName.HowToPlayText7]: "議論終了後、インポスターだと思う人に投票しよう。\n\n過半数の票が入ったプレイヤーは船外に追放されるので、投票は慎重に！\n\n情報不足から決め手に欠ける場合は、無実のクルーを追放しないように投票をスキップしてもよい。もっと情報を集めよう。",
        [StringName.HowToPlayText81]: "プラクティスモードで練習しよう！",
        [StringName.HowToPlayText82]: "クルーとして自分のタスクを設定したり、インポスターとして殺害計画を練ったりできる！",
