        [StringName.OnlineHelp]: "利用方法\n\n●ゲームをホストすると、ロビーパネルにゲームコードが表示されます。\n●ゲームコードを友達に共有して、プライベートルームを作成します。\n●または、「非公開」をタップして、「ゲームを探す」で見つかるようにします。\n●チャットが利用可能な場合、ホストはプレイヤーをバンしたり追放したりできます。\n●問題が解決しない場合は、support@innersloth.comまでお問い合わせください！",
