            "01": "ロールはカスタマイズ可能です！ゲームのホストは、エンジニアの通気孔使用回数やシェイプシフターのクールダウンなどを選択できます。また、ホストは各種ロールがゲームで発生する確率も決定できます。ロールが有効になっているかどうかは、ロビーの設定からいつでも確認可能です。",
            "02": "どんな設定が自分好みか、たくさん試して究極のロビーを作り上げたり、他のロビーに参加してカオスを巻き起こしましょう。今後も新たなロールをどんどん追加しますので、必要があればここで確認してくださいね。存分にお楽しみください！"
