        [StringName.PhantomBlurbLong]: "ファントムは透明になることで、クルーにこっそり近づいたり、捕まることなく犯罪現場から立ち去ることができる。透明になっている間はキルすることはできないけど、はしごやジップラインを使うことはできる。透明になったり、戻ったりすると大きな煙が発生しちゃうから、その場にクルーがいないことを確認しよう！それから、透明な状態はずっと続けられないから、タイミングを見計らおう。",
