        [StringName.HowToPlayTextImp6]: "Cierra puertas y atrapa a tus víctimas.",
        [StringName.HowToPlayTextImp7]: "Mata a la tripulación tras el tiempo de espera.",
        [StringName.HowToPlayText5]: "Durante el juego, los jugadores no pueden hablar entre ellos para que todo sea lo más justo posible entre la tripulación y los impostores.\n\nSi un impostor mata a un jugador, este no podrá hablar hasta el final de la partida.\n\nLos fantasmas pueden seguir haciendo tareas para contribuir a la victoria de la tripulación.",
        [StringName.HowToPlayText6]: "Cuando alguien informa de un cadáver o convoca una reunión urgente, la tripulación se reunirá para discutir lo que sabe sobre los impostores.\n\nAhora los jugadores pueden hablar libremente sobre quién creen que es impostor y qué información tienen. Mientras están jugando, los fantasmas no pueden hablar, pues ya saben quién es impostor.\n\nLos impostores defenderán su inocencia o acusarán a otro tripulante.",
        [StringName.HowToPlayText7]: "Tras la reunión, vota a quien creas que es impostor.\n\nQuien reciba más votos será expulsado de la nave, así que piensa bien.\n\nSi no tenéis información suficiente y llegáis a un acuerdo, podéis absteneros de votar para no expulsar a alguien inocente y seguir recabando información.",
        [StringName.HowToPlayText81]: "¡Entrena en el modo práctica!",
        [StringName.HowToPlayText82]: "Decide tus propias tareas como tripulante o practica tus dotes asesinas como impostor.",
