        [StringName.ReturnToGame]: "Reanudar",
        [StringName.LocalHelp]: "¿Problemas de conexión?\n\n● Todos debéis conectaros a la misma red wifi.\n● Todos debéis tener la misma versión (esquina inferior derecha).\n● Asegúrate de que la señal de red es potente.\n● A veces ayuda que otra persona sea anfitrión.\n● A veces ayuda reiniciar la aplicación o el teléfono.\n● ¿Aún tienes problemas? ¡Escríbenos a support@innersloth.com para contárnoslo!",
        [StringName.OnlineHelp]: "¿Cómo funciona?\n\n● Si eres anfitrión de una partida, aparecerá un código en el panel de sala.\n● Comparte ese código con tus amigos para que se unan a tu sala privada.\n● O toca «Privada» para que la sala sea pública y cualquiera pueda encontrarla usando «Buscar partida».\n● El anfitrión puede bloquear o expulsar a jugadores cuando el chat está disponible.\n● ¿Aún tienes problemas? ¡Escríbenos a support@innersloth.com para contárnoslo!",
        [StringName.EmergencyCount]: "{0} PUEDE CONVOCAR\n\n\n\nREUNIÓN(ES) URGENTE(S) MÁS",
