        [StringName.StarDisclaimer]: "Compra estrellas de Among Us ¡y desbloquea toda una galaxia de complementos! Usa las estrellas en la tienda del juego para comprar complementos y cubos cósmicos únicos. Las estrellas que compres aquí no podrán canjearse ni usarse en PlayStation® ni en Nintendo Switch™.",
