        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Rol de tripulante: {0}",
            "ImpostorRole": "Rol de impostor: {0}",
            "Scientist_01": "El científico puede acceder desde cualquier lugar a un panel de constantes portátil para comprobar el estado de la tripulación.",
            "Scientist_02": "Sin embargo, este panel deberá estar cargado y el científico tendrá que completar tareas para recargar la batería.",
            "Engineer_01": "El ingeniero es un tripulante que puede usar los conductos para moverse más rápido, así como sorprender a impostores que estén usando un conducto.",
            "Engineer_02": "No puedes quedarte dentro para siempre y es muy sospechoso, así que cuidado con donde apareces...",
            "GuardianAngel_01": "El ángel guardián es el fantasma de un tripulante que puede blindar y proteger temporalmente a otros tripulantes vivos.",
            "GuardianAngel_02": "Si reaccionas en el momento adecuado, evitarás que un impostor mate a su víctima. ¡Qué bien!",
            "Shapeshifter_01": "El cambiaformas puede cambiar su apariencia por la de otros tripulantes. Si lo haces bien, puedes incriminar a otros tripulantes y sembrar dudas sobre quién es el auténtico impostor.",
            "Shapeshifter_02": "Pero ten cuidado: el disfraz no dura para siempre y deja pruebas tras de sí.",
            "Noisemaker_01": "El escandaloso no es un tripulante normal y corriente. No tiene una habilidad que pueda usar como el resto de los roles. En lugar de eso, emite un aviso automáticamente cuando lo mata un impostor.",
            "Noisemaker_02": "El aviso hará que el impostor entre en pánico. ¡Mira cómo tus compañeros tripulantes corren a la escena del crimen para atrapar al asesino y vengar tu muerte!",
            "Tracker_01": "El rastreador puede ver la posición de un tripulante en el minimapa. Primero tiene que ponerse al lado de un tripulante para ponerle el dispositivo rastreador. Ten cuidado, que no sospechen de ti cuando te acerques a otro tripulante.",
            "Tracker_02": "El rastreo solo dura unos segundos, así que piénsatelo dos veces antes de elegir al objetivo. Otra cosa, no te quedes mirando el minimapa durante mucho tiempo, ¡los impostores pueden aprovechar el momento!",
            "Phantom_01": "El espectro se puede volver invisible para acercarse sigilosamente a un tripulante o irse de la escena del crimen sin que lo atrapen. No puede matar mientras es invisible, pero sí puede usar las escaleras y las tirolinas.",
            "Phantom_02": "Al volverse invisible o visible, crea una gran nube de humo, ¡así que asegúrate de que no hay tripulantes en la zona! La invisibilidad no dura eternamente, por lo que tendrás que calcular bien los tiempos al usarla.",
            "Detective_01": "¡El detective es un tripulante que destaca a la hora de resolver asesinatos! Gracias a sus notas, puede registrar información importante sobre cada muerte.",
            "Detective_02": "El detective puede interrogar a otros tripulantes para averiguar dónde estaban en el momento del asesinato. ¡Ata cabos y encuentra al asesino!",
            "Viper_01": "La víbora usa un ácido letal para matar a los tripulantes. Sus cuerpos se disuelven lentamente en tres fases antes de desaparecer por completo.",
            "Viper_02": "Una buena víbora se asegura de que nadie pueda encontrar ninguna de sus víctimas. ¡Sabotea para sacarle toda la ventaja que puedas!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "¡Los roles añaden un nivel nuevo de engaño y estrategia a la mecánica de juego clásica!",
            "02": "Se pueden asignar roles aleatorios tanto a los tripulantes como a los impostores, dependiendo de los ajustes de juego que haya elegido el anfitrión."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "¡Los roles se pueden personalizar! Los anfitriones de la partida pueden elegir cuántas veces los ingenieros pueden usar los conductos, la recarga del cambiaformas, etc. También pueden elegir un porcentaje de probabilidad para que estos roles se den en el juego. Siempre puedes ver si un rol está activado en los ajustes de la sala.",
            "02": "Experimenta con los ajustes como quieras para crear la sala definitiva o únete a una a ver cuánto caos puedes causar. Puede que añadamos roles nuevos al juego, así que echa un ojo siempre que lo necesites. ¡Diviértete!"
        },
