        [StringName.TagFiltersHelpFindGame]: "Puedes filtrar las búsquedas de partidas usando las etiquetas de la lista desplegable de filtros. Al usar filtros, encontrarás partidas con <i>exactamente</i> las etiquetas que elijas.\n\nPor ejemplo: si eliges <b>casual</b> y <b>experto</b>, solo encontrarás partidas etiquetadas con los filtros <b>casual</b> y <b>experto</b> a la vez.",
        [StringName.TagFiltersHelpCreate]: "Puedes etiquetar tu partida con filtros para ayudar a otras personas a encontrarla. Los filtros que elijas coincidirán <i>exactamente</i> con los resultados de búsqueda.\n\nPor ejemplo: si eliges <b>casual</b> y <b>experto</b>, solo verán tu partida las personas que busquen exactamente con los filtros <b>casual</b> y <b>experto</b>.",
        [StringName.CreateLabel]: "Crear",
        [StringName.NewGameMode]: "¡Nuevo modo de juego!",
        [StringName.NewModeInfo]: "¡Hay mucho en juego en este nuevo y apasionante modo!\n<i>Pero espera, este no es un juego del Escondite normal y corriente...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "¡Es sencillo!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "¡Tripulantes!",
        [StringName.HideSeekHowToPlayCaptionThree]: "¡Impostores!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Tripulantes:</b></color> Completad tareas para acelerar el contador, evitad al impostor y tratad de manteneros con vida hasta que termine el tiempo.\n\n<color=#FF3131><b>Impostor:</b></color> Busca a los tripulantes y cárgatelos a todos.",
        [StringName.HideSeekHowToPlaySubtextOne]: "No hay nada que deducir, solo intenta no gritar de miedo.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Domina tus habilidades para esconderte y actuar sigilosamente y sobrevive.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "En este modo puedes utilizar los conductos y un medidor de peligro de tecnología punta que te alertará cuando haya un impostor cerca. ¡El rango de visión del impostor es limitado, así que aprovecha tu ingenio, los conductos y los visores para evitarlo!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Los impostores no podrán usar los conductos en este modo, por lo que tendrás que actuar rápido para cazar a tu presa. ¡Está muy oscuro! Por suerte, cuentas con una linterna que te ayudará a encontrar a tu próxima víctima.",
        [StringName.HideSeekHowToPlayFinalHide]: "¡Comienza la cuenta atrás! Durante la recta final de la partida, el impostor contará con algo de ventaja: será más rápido, tendrá un mapa de búsqueda especial y un marcador direccional que apunta a dondequiera que estén los tripulantes con vida.\n\n¡Piensa rápido y sal pitando (estratégicamente) para ganar!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "¡Usa el control de la linterna en el lado derecho de la pantalla para dirigir la luz y mata a todos los tripulantes que te encuentres!",
