        [StringName.TagFiltersHelpFindGame]: "你可以通过从筛选下拉列表中选择标签来筛选游戏搜索。你选择的筛选将与搜索结果<i>完全匹配</i>。n\n例如：如果你选择<b>休闲</b>和<b>专家</b>，那么将只能找到同时使用<b>休闲</b>与<b>专家</b>筛选标签的游戏。",
        [StringName.TagFiltersHelpCreate]: "你可以使用筛选为游戏加上标签，帮助玩家找到你的游戏。你选择的筛选将与搜索结果<i>完全匹配</i>。\n\n例如：如果你选择<b>休闲</b>和<b>专家</b>，那么只有同时筛选搜索<b>休闲</b>和<b>专家</b>才可以看到你的游戏。",
