        [StringName.NewGameMode]: "全新游戏模式！",
        [StringName.NewModeInfo]: "在这个惊心动魄的模式里，你必须玩命才能胜利！\n<i>但是别着急，这可不是普通的捉迷藏......</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "太简单了！",
        [StringName.HideSeekHowToPlayCaptionTwo]: "船员！",
        [StringName.HideSeekHowToPlayCaptionThree]: "伪装者！",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>船员：</b></color>完成任务，推进计时，避开伪装者，坚持活下来，直到时间结束。\n\n<color=#FF3131><b>伪装者：</b></color>找到船员，杀掉他们。",
        [StringName.HideSeekHowToPlaySubtextOne]: "这里没有讨论和推理，只有惊声尖叫。",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "掌握躲藏和偷袭技能才能生存下去。",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "该模式下，你可以使用通风口，还能得到一个高科技的威胁指示器，当伪装者靠近时，你就会获得提醒。伪装者的视野有限，所以用你的智慧、通风口和指示器来躲开他们！",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "该模式下，伪装者无法进入通风口，所以你需要快速行动才能抓住猎物。四周一片漆黑！还好，你有手电筒可以帮你找到下一个受害者。",
        [StringName.HideSeekHowToPlayFinalHide]: "这是最最最后的终局对决。在游戏的最后时刻，伪装者的能力会获得提升：他们的速度更快，还会得到特殊的搜索地图，能够定位到幸存船员的所在位置。n\n要想获胜，就要机动灵活，有策略地逃跑！",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "使用屏幕右侧的手电筒模拟摇杆指引光束，杀死你能找到的所有船员！",
