        [StringName.HowToPlayText1]: "《Among Us》是款充滿合作與背叛的遊戲。\n\n玩家會扮演船員或偽裝者。",
        [StringName.HowToPlayText2]: "與 4 到 15 個玩家在線上或透過本地 WiFi 一起遊玩！",
        [StringName.HowToPlayText41]: "主持遊戲時，您可以控制遊戲進行的方式。",
        [StringName.HowToPlayText42]: "首先，請決定一起遊玩的對象！\n\n如果您想在線上和朋友一起遊玩，請設定成「私人」並把房間代碼分享給朋友。\n\n如果您想和世界各地的人一起遊玩，請設定成「公開」。",
        [StringName.HowToPlayText43]: "加入更多任務？把行走速度變快？增加更多偽裝者？身為主持者，您可以變更這些設定。不過，請務必先與其他玩家確認這些變更。",
        [StringName.HowToPlayText44]: "如果有人表現無禮或濫發訊息，主持者可以暫時踢出玩家作為警告，或禁止玩家進入特定線上房間。",
        [StringName.HowToPlayTextMap]: "玩家可以存取個人地圖，以協助在船上四處移動。",
        [StringName.HowToPlayTextCrew1]: "目標：填滿團隊任務列或找出偽裝者。",
        [StringName.HowToPlayTextCrew2]: "完成任務以填滿量表。",
        [StringName.HowToPlayTextCrew3]: "處理偽裝者的破壞。",
        [StringName.HowToPlayTextCrew4]: "在發現偽裝者時召開緊急會議。",
        [StringName.HowToPlayTextCrew5]: "舉報所發現的屍體。",
        [StringName.HowToPlayTextCrew6]: "檢查管理室地圖和保全系統以追蹤可疑活動。",
        [StringName.HowToPlayTextImp1]: "目標：殺死船員。",
        [StringName.HowToPlayTextImp2]: "混入船員之中。",
        [StringName.HowToPlayTextImp3]: "經由通風口隱匿行動。",
        [StringName.HowToPlayTextImp4]: "假裝執行任務。",
        [StringName.HowToPlayTextImp5]: "在船上搞破壞並混淆船員。",
        [StringName.HowToPlayTextImp6]: "關門並困住受害者。",
        [StringName.HowToPlayTextImp7]: "在冷卻時間之間殺死船員。",
        [StringName.HowToPlayText5]: "在面對面遊玩時，玩家不能彼此交談，以確保船員和偽裝者之間的遊戲公平性。\n\n如果有玩家被偽裝者殺害，該玩家在遊戲結束前都不能說話。\n\n鬼魂仍需執行獲指派的任務，以嘗試使船員獲勝。",
        [StringName.HowToPlayText6]: "如果有人舉報發現屍體或召開緊急會議，船員會一起討論他們所掌握關於偽裝者的情報。\n\n此時玩家可以公開談論自己認為偽裝者是誰及所掌握的情報。在面對面遊玩時，由於鬼魂已經知道偽裝者是誰，因此不得說話。\n\n偽裝者必須試著證明自己的無辜，或是指控其他船員。",
        [StringName.HowToPlayText7]: "討論後，請把票投給您認為是偽裝者的人。\n\n得到最多票的玩家將會被逐出船上，因此請明智地投票！\n\n如果您沒有足夠的資訊，而且其他船員也都這麼認為，則可以跳過投票以避免逐出無辜之人，並收集更多資訊。",
        [StringName.HowToPlayText81]: "在練習模式中進行訓練！",
        [StringName.HowToPlayText82]: "以船員的身分自行設定任務，或扮演偽裝者來演練殺人謀略！",
