        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "船員身分：{0}",
            "ImpostorRole": "內鬼身分：{0}",
            "Scientist_01": "科學家能夠在任何地方使用可攜式生命面板查看其他船員的狀態。",
            "Scientist_02": "不過，這個面板會消耗電能，科學家們必須要完成任務後才能幫面板充電。",
            "Engineer_01": "船員當中的工程師能夠使用通風管迅速移動，也能夠在這樣的過程中找到正在使用通風管的內鬼。",
            "Engineer_02": "但你沒辦法一直待在通風管裡面，而且你這麼做會容易引起他人的懷疑，所以在使用通風管時，請務必要小心謹慎……",
            "GuardianAngel_01": "守護天使是一種船員的鬼魂形態。這些守護天使能夠暫時啟動護盾保護其他還活著的船員。",
            "GuardianAngel_02": "抓準時機使用這個技能，就能夠阻止內鬼殺掉身旁的受害者。幸運！",
            "Shapeshifter_01": "變形者能夠改變自己的樣貌，並偽裝成其他船員的樣子。技術夠好的話，你就能靠這招來陷害其他船員，並製造混亂，讓大家搞不清楚誰才是真正的船員！",
            "Shapeshifter_02": "但你可要小心了，因為偽裝並不是永久有效的，而且還會讓你留下證據把柄。",
            "Noisemaker_01": "警示者可不是什麼普通的船員職業。警示者跟其他的職業不一樣，他們無法使用任何的東西。但警示者在被偽裝者殺死後，會自動發出警告讓大家知道。",
            "Noisemaker_02": "這樣的警告機制能夠制約偽裝者的下一步行動。這樣一來，其他船員就能立刻衝去命案現場，把偽裝者逮著正著，並為死者償命！",
            "Tracker_01": "追蹤者可以在小地圖上面看到追蹤船員的所在位置。在開始進行追蹤以前，你必須要先移動到目標船員的身邊，這樣你才能將追蹤裝置安裝到對方身上。在接近其他船員的時候還請小心，動作不要太明顯，不然你可是會讓對方起疑的。",
            "Tracker_02": "追蹤功能只能持續幾秒鐘的時間，所以還請慎選目標。此外，追蹤者也要小心，可別一直盯著小地圖，不然你很可能會成為偽裝者的下一個目標。",
            "Phantom_01": "魅影能夠隱身，並藉此偷偷靠近另一名船員，或是在殺人後神不知鬼不覺地離開現場。魅影在隱身狀態期間是能夠使用梯子和溜索的，但無法殺人。",
            "Phantom_02": "隱身或現身會在你的身邊產生大範圍的煙霧，所以在隱身或現身前，各位可要多加確認周圍有沒有其他船員在。隱身效果並非永久的，所以你隱身的時間點也很重要。",
            "Detective_01": "偵探是擅長偵破命案的船員！他們可以用筆記來記錄好每起命案的重要情報。",
            "Detective_02": "偵探可以順勢審問其他的船員，好確認案發當時他們身在何處。串連起所有的線索並找出兇手吧！",
            "Viper_01": "毒蛇會使用致命的酸液來毒殺船員。受害者的屍體會慢慢經歷三個溶解階段，到最後就會完全消失了。",
            "Viper_02": "聰明的毒蛇會確保自己殺害的對象永遠不會被人發現。善用「破壞」的機制來為自己取得優勢吧！"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "身份機制為這款經典遊戲再添一層技術成份，大家必須爾虞我詐、奇招盡出！",
            "02": "船員與內鬼都會擁有一個隨機分配的身份，這部份會以遊戲房長所安排的遊戲設定為主。"
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "大家會可以自訂這些身份的細節設定！遊戲房長可以指定工程師能夠使用通風管多少次，或是變形者技能的冷卻時間有多長，諸如此類。此外，遊戲房長也可以選擇這些身份在遊戲中出現的百分比機率。你隨時都能夠前往遊戲大廳的設定頁面，以查看該遊戲大廳是否有啟動身份機制！",
            "02": "我們歡迎大家按照自己的喜好嘗試不同的設定，為你的大廳安排出最棒的遊戲體驗，或是加入其他人的大廳，看看場面有多混亂。我們日後還會不斷推出新的身份，想要了解更多資訊的話，別忘了要回來這邊查看最新的資訊。我們祝你玩得開心！"
        },
