        [StringName.TagFiltersHelpFindGame]: "您可以在篩選條件下拉式清單中選取標籤來篩選遊戲搜尋結果。您選取的篩選條件將會與搜尋結果<i>完全相符</i>。\n\n舉個例子：如果您選取<b>休閒</b>和<b>專家</b>，您就只會找到同時具有<b>休閒</b>和<b>專家</b>標籤的結果。",
        [StringName.TagFiltersHelpCreate]: "您可以為自己的遊戲加上篩選條件標籤，讓其他玩家更容易找到您的遊戲。您選取的篩選條件將會與搜尋結果<i>完全相符</i>。\n\n舉個例子：如果您選取<b>休閒</b>和<b>專家</b>，那麼只有同時搜尋<b>休閒</b>和<b>專家</b>篩選條件的玩家會看到您的遊戲。",
        [StringName.CreateLabel]: "建立",
        [StringName.NewGameMode]: "新的遊戲模式！",
        [StringName.NewModeInfo]: "在這個令人心驚膽跳的遊戲模式中，您將背負極高的風險！\n<i>不過等等，這可不是尋常的捉迷藏遊戲...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "這非常簡單！",
        [StringName.HideSeekHowToPlayCaptionTwo]: "船員！",
        [StringName.HideSeekHowToPlayCaptionThree]: "偽裝者！",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>船員：</b></color>完成任務以加速時間進行，避開偽裝者，並在計時器時間結束前努力存活。\n\n<color=#FF3131><b>偽裝者：</b></color>找到船員並大開殺戒。",
        [StringName.HideSeekHowToPlaySubtextOne]: "這裡不需要社交推斷能力，只有恐懼和尖叫。",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "磨練您的躲藏和隱匿技巧，才能保住小命。",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "在這個模式中，您可以使用通風口並取得高科技的危險量表，當偽裝者接近您時，危險量表會通知您。偽裝者的視野會受到限制，因此您可以運用智慧、通風口和臉部裝飾來躲開他們！",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "偽裝者在這個模式中無法進入通風口，因此您需要快速行動才能抓到您的獵物。外面十分黑暗！幸好，您可以用手電筒來幫助自己尋找下一個受害者。",
        [StringName.HideSeekHowToPlayFinalHide]: "這是最後的倒數了。在遊戲的最後一段時間內，偽裝者將獲得能力提升，他們的行動速度會加快，並獲得特別的尋人地圖和指示存活船員位置的提示。\n\n運用策略，快速思考並逃離危險，才能獲得勝利！",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "使用畫面右側的手電筒虛擬搖桿來操控光束，殺死您找到的所有船員！",
