        [StringName.NoisemakerBlurbMed]: "在被擊殺的時候發出警告，\n好讓所有船員知道你的受害位置。",
        [StringName.NoisemakerBlurbLong]: "警示者可不是普通的船員職業。警示者跟其他的職業不一樣，他們無法使用任何的東西。但警示者在被偽裝者殺死後，會自動發出警告讓大家知道。這樣的警告機制能夠制約偽裝者的下一步行動。這樣一來，其他船員就能立刻衝去命案現場，把偽裝者逮著正著，並為死者償命！",
