        [StringName.PhantomBlurb]: "魅影能夠隱身",
        [StringName.PhantomBlurbMed]: "以隱身狀態四處移動，或是在殺人後偷偷離開現場。",
        [StringName.PhantomBlurbLong]: "魅影能夠隱身，並藉此偷偷靠近另一名船員，或是在殺人後神不知鬼不覺地離開現場。魅影在隱身狀態期間是能夠使用梯子和溜索的，但無法殺人。隱身或現身會在你的身邊產生大範圍的煙霧，所以在隱身或現身前，各位可要多加確認周圍有沒有其他船員在。隱身效果並非永久的，所以你隱身的時間點也很重要。",
