        [StringName.TrackerBlurbMed]: "在一名船員身上安裝追蹤裝置，\n並藉此使用地圖來追蹤對方的行蹤。",
        [StringName.TrackerBlurbLong]: "追蹤者可以在小地圖上面看到追蹤船員的所在位置。在開始進行追蹤以前，你必須要先移動到目標船員的身邊，這樣你才能將追蹤裝置安裝到對方身上。在接近其他船員的時候還請小心，動作不要太明顯，不然你可是會讓對方起疑的。追蹤功能只能持續幾秒鐘的時間，所以還請慎選目標。此外，追蹤者也要小心，可別一直盯著小地圖，不然你很可能會成為偽裝者的下一個目標。",
