        [StringName.MeetingHasVoted]: "Vótáil {0}. Ag fanacht le {1} duine.",
        [StringName.HowToPlayText1]: "Is cluiche comhoibríoch fealltóireachta Among Us.\n\nIs féidir le himreoir a bheith ina Loingseoir nó ina Fhealltóir.",
        [StringName.HowToPlayText2]: "Imir in éineacht le 4 go 15 imreoir ar líne nó ar an WiFi áitiúil!",
        [StringName.HowToPlayText41]: "Má tá cuntas Among Us agat ar ardán eile, seans go bhféadfaidh tú nasc a dhéanamh leis an gcuntas sin! Nó de rogha air sin, féadfaidh tú cuntas úrnua a chruthú.",
        [StringName.HowToPlayText42]: "Ar dtús, roghnaigh cé leis a bhfuil tú chun imirt! \n\nAn bhfuil fonn ort imirt le cairde ar líne? Cuir cluiche príobháideach ar bun agus roinn an cód. \n\nAn bhfuil fonn ort imirt go poiblí ar líne? Roghnaigh cluiche poiblí.",
        [StringName.HowToPlayText43]: "An bhfuil níos mó tascanna uait? Tuilleadh Fealltóirí? An bhfuil fonn ort rith níos tapúla? Mar an t-óstach, is féidir leat na socruithe seo a athrú! Féach chuige go ndeimhníonn tú na hathruithe le do chomhimreoirí.",
        [StringName.HowToPlayText44]: "Má bhíonn aon duine míbhéasach nó ag spamáil, féadfaidh an t-óstach é a dhíbirt go sealadach mar fholáireamh nó é a bhacadh ar dul isteach ar chluiche áirithe ar líne.",
        [StringName.HowToPlayTextMap]: "Tá léarscáil ag gach duine chun a bhealach a dhéanamh tríd an spáslong.",
        [StringName.HowToPlayTextCrew1]: "Sprioc: Líon Tascbharra an Ghrúpa nó Aimsigh an Fealltóir.",
        [StringName.HowToPlayTextCrew2]: "Críochnaigh tascanna chun an barra a líonadh.",
        [StringName.HowToPlayTextCrew3]: "Téigh i nGleic le Sabaitéireacht an Fhealltóra.",
        [StringName.HowToPlayTextCrew4]: "Cuir cruinniú éigeandála ar bun nuair a thagtar ar an bhFealltóir.",
        [StringName.HowToPlayTextCrew5]: "Tuairiscigh coirp.",
        [StringName.HowToPlayTextCrew6]: "Seiceáil Léarscáil an Riaracháin agus an Córas Slándála le haghaidh gníomhaíochta amhrasaí.",
        [StringName.HowToPlayTextImp1]: "Sprioc: Maraigh an Criú go léir.",
        [StringName.HowToPlayTextImp2]: "Tit isteach leis an gCriú.",
        [StringName.HowToPlayTextImp3]: "Éalaigh trí na gaothairí.",
        [StringName.HowToPlayTextImp4]: "Lig ort féin go bhfuil tú ag déanamh tascanna.",
        [StringName.HowToPlayTextImp5]: "Déan sabaitéireacht ar an spáslong agus cuir mearbhall ar an gCriú.",
        [StringName.HowToPlayTextImp6]: "Dún doirse agus sáinnigh íospartaigh.",
        [StringName.HowToPlayTextImp7]: "Maraigh an Criú idir agaí athnuachana.",
        [StringName.HowToPlayText5]: "Má tú i mbun cluichíochta le daoine eile san áit chéanna leat, ní cheadaítear caint le go gcoinneofar an cluiche cothrom don Chriú agus don Fhealltóir araon. \n\nMá mharaíonn an Fealltóir imreoir, ní féidir leis-sean labhairt go gcríochnóidh an cluiche. \n\nDéanann Taibhsí a gcuid tascanna chun bua an Chriú a bhaint amach.",
        [StringName.HowToPlayText6]: "Nuair a thuairiscítear corp nó nuair a chuirtear cruinniú éigeandála ar bun, pléann an Criú an méid atá ar eolas acu faoin bhFealltóir.\n\nIs féidir le himreoirí labhairt gan srian faoin té a cheapann siad arb é an Fealltóir é agus faoin eolas atá acu air. Nuair a imríonn tú in éineacht le daoine eile, ní féidir le Taibhsí labhairt mar go mbíonn a fhios acu cé hé an Fealltóir.\n\nDéanfaidh an Fealltóir iarracht an dallamullóg a chur ar na daoine eile.",
        [StringName.HowToPlayText7]: "Tar éis an scéal a phlé, vótáil don té a cheapann tú arb é an Fealltóir é.\n\nPé duine a bhaineann tromlach na vótaí amach, eisteilgfear é; vótáil go haireach!\n\nMura bhfuil eolas a dhóthain ann, is féidir leis an gCriú léim thar an bpróiseas vótála chun eistealgan duine neamhchiontach a sheachaint chun seans eile a fháil ar thuilleadh eolais a bhailiú.",
        [StringName.HowToPlayText81]: "Déan cleachtadh sa mhodh \"Cleachtadh\"!",
        [StringName.HowToPlayText82]: "Socraigh do chuid tascanna féin mar Loingseoir nó déan cleachtadh ar do chuid straitéisí maraithe mar Fhealltóir!",
