        [StringName.LocalHelp]: "Fadhbanna ceangail?\n\n● Cinntigh go bhfuil gach duine ceangailte leis an WiFi céanna\n● Cinntigh go bhfuil an leagan ionann ag gach duine (féach ar an taobh deas thíos)\n● Cinntigh go bhfuil ceangal WiFi láidir agat\n● Scaití, cabhraíonn sé má óstálann duine eile\n● Scaití, cabhraíonn sé má atosaíonn tú an aip... \n● Scaití, cabhraíonn sé má atosaíonn tú d'fhón...\n● Fadhbanna fós agat? Téigh i dteangmháil linn support@innersloth.com",
        [StringName.OnlineHelp]: "Conas a oibríonn sé?\n\n● Nuair a óstálann tú cluiche, bíonn cód imeartha ar phainéal an tseomra.\n● Roinn an cód le cairde chun cluiche príobháideach a chruthú.\n● Nó cliceáil ar \"Príobháideach\" chun cluiche poiblí a chruthú.\n● Is féidir leis an óstach imreoirí a dhíbirt nó cosc a chur orthu agus an comhrá ar siúl.\n● An bhfuil fadhbanna fós agat? Téigh i dteangmháil linn support@innersloth.com",
        [StringName.EmergencyCount]: "\n\n\n\n AN LÍON CRUINNITHE ÉIGEANDÁLA ATÁ FÁGTHA AG LOINGSEOIR {0}",
        [StringName.EmergencyNotReady]: "CAITHFIDH AN CRIÚ FANACHT\n\n\n\nGO DTAGA AN CHÉAD CHRUINNIÚ EILE",
        [StringName.EmergencyDuringCrisis]: "NÍ FÉIDIR LEAT CRUINNIÚ A CHUR AR BUN\nI RITH GEARCHÉIME",
        [StringName.EmergencyRequested]: "CRUINNIÚ IARRTHA\nAG FANACHT LEIS AN ÓSTACH",
        [StringName.AdPolicyTitle]: "Polasaí Fógraíochta",
        [StringName.AdPolicyText]: "An bhfuil cead againn do shonraí pearsanta a úsáid chun fógraí saincheaptha a chruthú duit? Má tá, baileoidh ár gcuid comhpháirtithe fógraíochta ar nós Google AdMob agus Unity Ads do shonraí go huathoibríoch agus úsáidfidh siad fianáin agus aitheantóirí gléis chun fógraí pearsantaithe a chruthú. Mura dtugann tú an cead sin dúinn, seans go bhfeicfidh tú fógraí nach bhfuil curtha in oiriúint duit. Chun fáil réidh leis na fógraí ar fad, ceannaigh an t-uasghrádú atá saor ó fhógraí [httpstore]anseo[], agus ní fheicfidh tú nó do chairde aon fhógraí agus tú i d'óstach! Chun tuilleadh a fhoghlaim faoinár gcleachtais phríobháideachta féin agus faoi chleachtais phríobháideachta ár gcuid comhpháirtithe fógraíochta, féach [https://www.innersloth.com/privacy-policy/]Polasaí Príobháideachta[]. Is féidir do chinneadh a athrú aon uair is mian leat i roghchlár na socruithe faoi \"Sonraí\".",
