        [StringName.LinkExistingAccountExplainConfirm]: "A luaithe a dheimhníonn tú, athshocróidh muid do chuntas Among Us {0} le hiompórtáil na sonraí ar do chuntas eile a ullmhú.\n\n<color=#{1}>FAINIC: DÉAN CINNTE DÓ GO BHFUIL CUNTAS EILE AGAT AR MHAITH LEAT É A NASCADH LEIS AN GCUNTAS SEO SULA LEANFAIDH TÚ ORT.</color>\n\nDéanfar nialasach de XP, Beans, Pods agus earraí ar athshocrú do chuntas {0}. Ní bheidh aon dul siar air seo.",
