        [StringName.StarDisclaimer]: "Ceannaigh ## Réalta Among Us chun réaltra mór nua de roghanna cur in oiriúint a dhíghlasáil! Caith Réaltaí sa siopa ionchluiche chun cosmaidí eisiacha agus Ciúbanna Cosmacha ar leith a fháil. Ní féidir Réaltaí a cheannaítear anseo a úsáid ná a fhuascailt ar PlayStation® ná ar Nintendo Switch™.",
