        [StringName.ErrorDisconnectPacket]: "Dícheangalaíodh ón bhfreastalaí thú.",
        [StringName.AndroidAssetBundleWarning]: "Caithfidh Among Us inneachar breise a íoslódáil leis an suiteáil a chríochnú. Brúigh \"Glacaim Leis\" le leanúint ar aghaidh.",
        [StringName.ItchNoStars]: "Faraor, ní féidir Réaltaí a cheannach ar itch.io. Bíodh sin mar atá, má nascann tú do chuntas itch.io le hardán eile (.i. le leaganacha eile PC), beidh tú ábalta Réaltaí a cheannach leis an gcuntas sin! Tabhair faoi deara nach féidir Réaltaí a cheannaíonn tú ar Nintendo Switch™ a úsáid ar ardáin eile.",
