        [StringName.ScientistBlurb]: "Féach ar chomharthaí beatha pé uair is mian leat",
        [StringName.EngineerBlurb]: "Is féidir leis veinteáil (úsáid a bhaint as na gaothairí)",
        [StringName.GuardianAngelBlurb]: "Cosain na Loingseoirí a mhaireann",
        [StringName.ShapeshifterBlurb]: "Cuir bréagriocht ort féin",
