        "RolesHelp": {
            "default": "undefined",
            "CrewmateRole": "Ról Leathbhádóra: {0}",
            "ImpostorRole": "Ról Fealltóra: {0}",
            "Scientist_01": "Féadann an tEolaí painéil comharthaí beatha a úsáid aon áit chun stádas an chriú a sheiceáil.",
            "Scientist_02": "Mar sin féin, caithfidh an painéal a bheith luchtaithe agus mar sin beidh ar an Eolaí tascanna a chríochnú chun é sin a bhaint amach.",
            "Engineer_01": "Is Loingseoir an tInnealtóir atá ábalta ar veinteáil thart go tapa, agus ar na Fealltóirí a fheiceáil agus iad i mbun veinteála.",
            "Engineer_02": "Ní féidir fanacht sna gaothairí i bhfad, áfach, agus tarraingeoidh sé amhras ort, mar sin bí aireach ar cé atá timpeall agus tú ag veinteáil...",
            "GuardianAngel_01": "Is taibhse Loingseora an tAingeal Coimhdeachta. Is féidir leis Loingseoirí a chosaint ó bhás go sealadach.",
            "GuardianAngel_02": "Déan amhlaidh san am ceart agus sáróidh tú na Fealltóirí. Nach maith é!",
            "Shapeshifter_01": "Féadann an tIlchruthach a riocht a athrú trí bhréagriocht Loingseoirí eile a chur air féin. Sáinnigh Loingseoirí eile agus cothaigh anord!",
            "Shapeshifter_02": "Ach seachain - ní mhaireann an bréagriocht go deo agus beidh dríodar ina dhiaidh.",
            "Noisemaker_01": "Ní gnáthról an Fothramálaí. Níl cumas ar leith aige murab ionann is na róil eile. Ina ionad sin, tugtar foláireamh nuair a mharaíonn fealltóir é.",
            "Noisemaker_02": "Is réidh a chuireann an foláireamh scaoll san fhealltóir. Féach agus na Loingseoirí eile ag brostú chun láthair na coire i gcomhair breith ar an marfóir agus díoltas a imirt air!",
            "Tracker_01": "Is féidir leis an Lorgaire Loingseoir a fheiceáil ar an léarscáil. Ní féidir leis rianaire a chur ar Loingseoir gan a bheith ina aice. Déan cinnte de gan cuma ró-amhrasach a bheith ort agus tú ag dul faoi dhéin leathbhádóra.",
            "Tracker_02": "Ní mhaireann an rianú ach roinnt soicindí, mar sin, déan rogha chiallmhar agus ná féach ar an léarscáil rófhada mar beidh tú somharaithe!",
            "Phantom_01": "Is féidir leis an Scáil dul as radharc na súl i gcomhair éalú suas ar Loingseoir nó imeacht gan fhios i ndiaidh Loingseoir a mharú. Ní féidir leis aon duine a mharú agus é as radharc, ach is féidir leis dréimirí a dhreapadh agus ziplínte a úsáid.",
            "Phantom_02": "Nuair a théann an Scáil as radharc, déantar múr mór deataigh, mar sin, ba chóir dó bheith deimhin de nach bhfuil aon Loingseoir cóngarach dó nuair a dhéanann sé amhlaidh! Ní féidir leis an Scáil fanacht as radharc go deo, mar sin, déan cinnte de go dtéann tú as radharc in am trátha.",
            "Detective_01": "Is loingseoir é an Bleachtaire a réitíonn cásanna dúnmharuithe go han-chruinn! Lena gcuid nótaí, is féidir leo sonraí i dtaobh gach maraithe a chlárú i scríbhinn.",
            "Detective_02": "Ansin, is féidir leis an mBleachtaire Loingseoirí eile a Cheistiú chun an áit a raibh siad a fháil amach ag am an dúnmharaithe. Ceangail na poncanna agus aimsigh an marfóir!",
            "Viper_01": "Úsáideann an Nathair Nimhe aigéad marfach chun Loingseoirí a mharú. Leánn corpáin go mall i dtrí chéim sula n-imíonn siad as radharc go hiomlán.",
            "Viper_02": "Déanann Nathair Nimhe cliste deimhin de nach n-aimsítear aon chorpán riamh. Úsáid sabaitéireachtaí le do leas!"
        },
        "RolesHelpIntro": {
            "default": "undefined",
            "01": "Cuireann na róil le straitéis an chluiche agus tugann siad deis do dhaoine daoine eile a chur amú!",
            "02": "Is féidir róil a chur ar Loingseoirí agus ar Fhealltóirí araon ar bhonn fánach, ag brath ar na socruithe a roghnaíonn an t-óstach."
        },
        "RolesHelpOutro": {
            "default": "undefined",
            "01": "Is féidir na róil a chur in oiriúint! Bíonn óstach an chluiche ábalta ar roghnú cá mhéad uair is féidir le hInnealtóir veinteáil, nó cá fhad a mhairfidh aga athnuachana bréagreachta, srl. Ina theannta sin, is féidir leis roghnú an seans go mbeidh ról áirithe sa chluiche. Is féidir a fheiceáil an bhfuil ról áirithe i bhfeidhm i socruithe sheomra an chluiche!",
            "02": "Bain triail as socruithe éagsúla chun go gcuirfidh tú feabhas ar do sheomra feithimh, nó téigh isteach i seomra eile chun anord a chruthú. Seans go gcuirfimid róil eile leis an gcluiche amach anseo, mar sin ná bíodh drogall ort súil a chaitheamh ar an áit seo arís. Bain súp as!"
        },
        [StringName.YourRoleIs]: "Is éard atá ionat ná",
        [StringName.ShapeshiftAbility]: "Bréagriocht",
