        [StringName.ProtectedRecently]: "Chosain an tAingeal Coimhdeachta duine le gairid...",
        [StringName.ScientistBlurbMed]: "Féach ar chomharthaí beatha pé uair is mian leat.\nDéan do chuid tascanna chun an cadhnra a luchtú.",
        [StringName.ScientistBlurbLong]: "Féadann an tEolaí painéil comharthaí beatha a úsáid aon áit chun stádas an chriú a sheiceáil. Mar sin féin, caithfidh an painéal a bheith luchtaithe agus mar sin beidh ar an Eolaí tascanna a chríochnú chun é sin a bhaint amach.",
        [StringName.EngineerBlurbMed]: "Is féidir leis veinteáil (úsáid a bhaint as na gaothairí).",
        [StringName.EngineerBlurbLong]: "Is Loingseoir é an tInnealtóir atá ábalta veinteáil thart go sciobtha, agus na Fealltóirí a fheiceáil agus iad ag veinteáil. Ní féidir fanacht ann i bhfad, áfach, mar sin bí aireach ar cé atá timpeall agus tú ag veinteáil...",
        [StringName.GuardianAngelBlurbMed]: "Cuir na Loingseoirí faoi do choimirce.",
        [StringName.GuardianAngelBlurbLong]: "Is é an tAingeal Coimhdeachta ná an chéad Loingseoir a fhaigheann bás. Is féidir leis Loingseoirí a chosaint ó bhás go sealadach. Nach maith duit é!",
        [StringName.ShapeshifterBlurbMed]: "Cuir bréagriocht ort féin trí chuma Loingseoirí\neile a chur ort.",
        [StringName.ShapeshifterBlurbLong]: "Féadann an tIlchruthach a chuma a athrú trí bhréagriocht Loingseoirí eile a chur air féin. Sáinnigh Loingseoirí eile agus cothaigh anord. Fainic - ní mhaireann an bréagriocht go deo agus beidh dríodar ina dhiaidh.",
