        [StringName.ErrorCommunications]: "Tá do chuid socruithe cumarsáide do do chosc. Chun a bheith páirteach sa chluiche seo, cuir comhrá le daoine eile i bhfeidhm.",
        [StringName.SettingsColorblind]: "Modh Dathdhaille",
        [StringName.MergeGuestAccountText]: "Tá <link=\"https://www.innersloth.com/merging-guest-accounts/\">cuntas cuairteora</link> ar an ngléas seo! Ní féidir linn a leithéid a chur ar fáil a thuilleadh, mar sin ceanglófar na hearraí agus na haireagadraí agus an dul chun cinn a bhaineann leis an gcuntas sin leis an gcuntas {0}.\n\nMá bhaineann daoine eile úsáid as an ngléas seo (bíodh sé ina ríomhaire nó ina fhón, srl.), ná déan dearmad gur le gach duine acu an cuntas sin. Mar sin, ní bheidh siad ábalta an cuntas cuairteora sin a chumasc le cuntas eile má leanann tú ar aghaidh. Ní fhéadfaidh tú an cumascseo a dhéanamh ach uair amháin. Ní bheidh tú ábalta na hearraí ná na hairgeadraí ná an dul chun cinn a bhaineann leis an gcuntas a cheangal le ceann eile arís.\n\nDeimhnigh, le do thoil, gur mhaith leat an cuntas cuairteora a chumasc leis an gcuntas {0}.",
        [StringName.MergeGuestAccountTitle]: "Comhcheangail Cuntas Cuairteora",
        [StringName.ManageAccountTitle]: "Bainistigh Cuntas",
        [StringName.ManageAccountText]: "Téigh go <link=\"https://accounts.innersloth.com/\">https://accounts.innersloth.com</link> leis an gcuntas a bhainistiú, a chumasc nó má tá fadhb ar bith eile agat.",
        [StringName.SignInIssueTitle]: "Earráid Chuntais {0}",
        [StringName.SignInIssueText]: "Ní féidir cuntas Among Us a chruthú le do {0} de dheasca srianta cuntais.\n\nIs féidir leat leanúint ar aghaidh ag imirt Among Us leis an ngléas seo, ach ní bheidh gach gné ar fáil, na rudaí seo a leanas san áireamh: nascadh cuntais, ceannacháin Réaltaí agus aistriú earraí go gléas eile. Má tá ceist ar bith agat, cuir ríomhphost chun support@innersloth.com",
        [StringName.FriendListUnavailable]: "Níl an Liosta Cairde le Fáil",
