        [StringName.TagFiltersHelpFindGame]: "Féadfaidh tú clib a chur ar do chluiche le scagairí ón liosta. Luífidh na torthaí cuardaigh leis na scagairí a roghnóidh tú.\n\nMar shampla: Má roghnaíonn tú <b>\"Réchúiseach\"</b> agus <b>\"Saineolaí\"</b> ní fheicfidh tú ach na cluichí ag a bhfuil na scagairí sin araon.",
        [StringName.TagFiltersHelpCreate]: "Féadfaidh tú clib a chur ar do chluiche le scagairí ionas go mbeidh cluichirí eile ábalta do chluiche a fheiceáil. Luífidh na torthaí cuardaigh leis na scagairí a roghnóidh tú.\n\nMar shampla: Má roghnaíonn tú <b>\"Réchúiseach\"</b> agus <b>\"Saineolaí\"</b> ní bheidh an cluiche le feiceáil ach ag daoine a dhéanfaidh cuardach ar na scagairí sin araon.",
        [StringName.CreateLabel]: "Cruthaigh",
        [StringName.NewGameMode]: "Modh Cluiche Nua!",
        [StringName.NewModeInfo]: "Bíonn cuid mhór i ngeall sa mhodh seo. \n<i>Ach seachain thú féin, ní gnáthfholach bíog é...</i>",
        [StringName.HideSeekHowToPlayCaptionOne]: "Tá sé simplí!",
        [StringName.HideSeekHowToPlayCaptionTwo]: "Loingseoirí!",
        [StringName.HideSeekHowToPlayCaptionThree]: "Fealltóirí!",
        [StringName.HideSeekHowToPlayPageOne]: "<color=#38F25D><b>Loingseoirí:</b></color> Críochnaigh do chuid tascanna chun an cluiche a chiorrú, seachain an Fealltóir agus fan i do bheatha go dtiocfaidh an cluiche chun deiridh. \n\n<color=#FF3131><b>An Fealltóir:</b></color> Faigh na Loingseoirí agus maraigh gan trua iad!",
        [StringName.HideSeekHowToPlaySubtextOne]: "Níl aon tátal sóisialta anseo. Níl ann ach scréacha uafáis.",
        [StringName.HideSeekHowToPlayCrewmateInfoOne]: "Faigh máistreacht ar dhul i bhfolach agus ar éalú araon chun go mairfidh tú.",
        [StringName.HideSeekHowToPlayCrewmateInfoTwo]: "Is féidir veinteáil sa mhodh seo agus ina theannta san tá Méadar Contúirte le fáil a chuireann teacht an Fhealltóra in iúl duit. Níl ach gearr-radharc ag an bhFealltóir, mar sin, bain úsáid éifeachtúil as do chumas, as na gaothairí agus cealtracha lena sheachaint!",
        [StringName.HideSeekHowToPlayImpostorInfoOne]: "Ní féidir le Fealltóirí veinteáil sa mhodh seo, mar sin beidh ort a bheith tapa chun breith ar do chreach. Tá sé dorcha! Ar ámharaí an tsaoil tá Tóirse agat i gcomhair íospartaigh a fháil.",
        [StringName.HideSeekHowToPlayFinalHide]: "Bíonn tuilleadh cumhachta ag an bhFealltóir nuair a bhíonn an cluiche ag teacht chun deiridh - bíonn sé níos tapa, bíonn léarscáil tóraíochta aige ag a bhfuil cling threorach a thaispeánann treo na Loingseoirí atá fós ina mbeatha.\n\nSmaoinigh ar an toirt agus teith ar bhonn straitéiseach chun an bua a fháil!",
        [StringName.HideSeekHowToPlayFlashlightMobile]: "Bain úsáid as luamhán stiúrtha an Tóirse atá ar an taobh deas den scáileán chun an gá a dhíriú agus maraigh gach Loingseoir ar féidir leat a fháil!",
        [StringName.HideSeekHowToPlayFlashlightDefault]: "Úsáid do luchóg chun an Tóirse a dhíriú ar na Loingseoirí agus úsáid é chun gach aon Loingseoir a mharú.",
        [StringName.HideSeekHowToPlayFlashlightConsoles]: "Úsáid do luamhán stiúrtha deas chun an Tóirse a dhíriú agus maraigh gach Loingseoir a fheicfidh tú!",
        [StringName.HideSeekHowToPlayFlashlightPlayStation]: "Úsáid do luamhán stiúrtha deas chun an Tóirse a dhíriú agus maraigh gach Loingseoir a fheicfidh tú!",
        [StringName.HideSeekHowToPlayFlashlightSwitch]: "Úsáid do Right Stick deas chun an Tóirse a dhíriú agus maraigh gach Loingseoir a fheicfidh tú!",
