        [StringName.EosAccountSilentMergeFail]: "Theip ar do chuntas Among Us a thabhairt chun críche. Bain triail eile as nó lean ar aghaidh trí aoichuntas. Déanfar an dul chun cinn a shábháil, ach molaimid duit cuntas a shocrú i gceart chun taitneamh a bhaint as gach gné de Among Us. \n\nAn bhfuil tú chun triail eile a bhaint as?",
        [StringName.AskForEosAccount]: "An bhfuil cuntas Among Us agat cheana féin? (Tugtar cuntas Epic Online Services ar a leithéid leis.)\n\nMá imir tú Among Us tríd an ngléas seo roimhe seo, roghnaigh 'Tá'.",
        [StringName.KwsCreateFail]: "Och! Theip ar an ríomhphost ceada a sheoladh. Bain triail eile as nó lean ar aghaidh sa mhodh as líne.\n\nAn bhfuil tú chun triail eile a bhaint as?",
        [StringName.MissingGuardianEmailText]: "Tá seoladh ríomhphoist caomhnóra in easnamh ar do chuntas. Tá orainn cead a iarraidh ar do chaomhnóir (trí ríomhphost) roimh dhul ar aghaidh. Má thugann sé cead, beidh tú in ann úsáid a bhaint as saorchomhrá ar líne agus d'ainm úsáideora a athrú. Iarr ar dhuine fásta chun cabhrú leat!",
