        [StringName.ReportNotificationBody]: "Déanfaidh an fhoireann mhodhnóireachta athbhreithniú ar an eolas a thuairiscigh tú agus",
        [StringName.ErrorClientTimeout]: "Dícheanglaíodh thú ón bhfreastalaí. B’fhéidir gur fabht faoi deara é a bhaineann le freastalaí nó le líonra nó le gléas. Seiceáil láidreacht do líonra.\n\nMá tharlaíonn sé seo go minic, seans go bhfuil do ghléas róshean nó nach bhfuil sé cumhachtach a dhóthain. Bain triail as an gcluiche a imirt le gléas eile.",
        [StringName.ErrorClientTimeoutConsole]: "Dícheanglaíodh thú ón bhfreastalaí. B’fhéidir gur fabht faoi deara é a bhaineann le freastalaí nó le líonra. Seiceáil láidreacht do líonra.",
