        [StringName.NoisemakerRole]: "Fothramálaí",
        [StringName.NoisemakerBlurb]: "Tabhair foláireamh nuair a fhaigheann tú bás",
        [StringName.NoisemakerBlurbMed]: "Tabhair foláireamh a thabharfaidh le fios an áit\na raibh tú nuair a maraíodh thú.",
        [StringName.NoisemakerBlurbLong]: "Ní gnáthról an Fothramálaí. Níl cumas ar leith aige murab ionann is na róil eile. Ina ionad sin, tugtar foláireamh nuair a mharaíonn fealltóir é. Is réidh a chuireann an foláireamh scaoll san fhealltóir. Féach agus na Loingseoirí eile ag brostú chun láthair na coire i gcomhair breith ar an marfóir agus díoltas a imirt air!",
