        [StringName.PhantomAbility]: "Téigh ó Radharc",
        [StringName.PhantomAbilityUndo]: "Tar i Radharc",
        [StringName.PhantomRole]: "Scáil",
        [StringName.PhantomBlurb]: "Téigh ó radharc",
        [StringName.PhantomBlurbMed]: "Téigh as radharc chun éalú thart nó imeacht\ngan fhios i ndiaidh duine a mharú.",
        [StringName.PhantomBlurbLong]: "Is féidir leis an Scáil dul as radharc na súl i gcomhair éalú suas ar Loingseoir nó imeacht gan fhios i ndiaidh Loingseoir a mharú. Ní féidir leis aon duine a mharú agus é as radharc, ach is féidir leis dréimirí a dhreapadh agus ziplínte a úsáid. Nuair a théann an Scáil as radharc, déantar múr mór deataigh, mar sin, ba chóir dó bheith deimhin de nach bhfuil aon Loingseoir cóngarach dó nuair a dhéanann sé amhlaidh! Ní féidir leis an Scáil fanacht as radharc go deo, mar sin déan cinnte de go dtéann tú as radharc in am trátha.",
        [StringName.PhantomCooldown]: "Aga Athnuachana an Dul as Radharc",
        [StringName.PhantomDuration]: "Fad a Fhanfar as Radharc",
        [StringName.TrackerRole]: "Lorgaire",
