        [StringName.TrackerBlurbMed]: "Bain úsáid as rianaire chun Loingseoir a lorg leis\nan léarscáil.",
        [StringName.TrackerBlurbLong]: "Is féidir leis an Lorgaire Loingseoir a fheiceáil ar an léarscáil. Ní féidir leis rianaire a chur ar Loingseoir gan a bheith ina aice. Déan cinnte de gan cuma ró-amhrasach a bheith ort agus tú ag dul faoi dhéin Loingseora. Ní mhaireann an rianú ach roinnt soicindí, mar sin, déan rogha chiallmhar agus ná féach ar an léarscáil rófhada mar beidh tú somharaithe!",
